c     ****************************************************************72
      subroutine elmt05(d,ul,xl,ix,tl,s,p,ndf,ndm,nst,isw)
c     ****************************************************************72

c     ################################################################72
c     Element 05
c     J. Bluhm 18.09.2014
c     Beschreibung:
c     Phasen:
c     - Solid (S) - thermo-elastisch, inkompressibel
c     - Liquid(L) - inkompressibel
c     Gleichungssystem - BaMoMi -- Mixture
c                      - BaEnMi -- Mixture
c                      - BaMaSo -- Solid
c                      - SaCoMi -- Mixture
c     - 2D
c     FG (5):
c        - Verschiebung Solid  (1,2)
c        - Temperatur          (3)
c        - Volumenanteil Solid (4)
c        - Druck Liquid        (5)
c     Element: Lineares 4 Knoten Rechteckelement
c     - 3D
c     FG (6):
c        - Verschiebung Solid  (1,2,3)
c        - Temperatur          (4)
c        - Volumenanteil Solid (5)
c        - Druck Liquid        (6)
c     Element: Lineares 8-Knoten Brick-Element
c              Nichtlineares 10-Knoten Teraeder-Element
c     ################################################################72

c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      include   'bdata.h'
      include   'cdata.h'
      include   'comblk.h'
      include   'debugs.h'
      include   'eldata.h'
      include   'hdata.h'
      include   'iofile.h'
      include   'pdata6.h'
      include   'prstrs.h'
      include   'strnum.h'
      include   'tdata.h'
c     ----------------------------------------------------------------72
      include   'xDatMetDefS_jbxx.h'
      include   'xDatB_jbxx.h'      
c      include   'xDatBase_jbxx.h'
      include   'xDatMaPa_jbxx.h'
c     ----------------------------------------------------------------72
      integer ix(*)
      integer ndf,ndm,nst,isw
      integer istb
      integer ndoff,ndele,nhistele,imatID
      integer nd4,nd5,nd7,nd8,numtan,nd10,nd11
      integer nhistmat,isymm,istart
      integer lint,iste
      integer i,j,k,l
      integer ii,ik,io,ip,ir,is
      real*8 xg(3),f3d(3,3),f3ddot(3,3),
     &       g03d(6),g3d(6),s3d(24),aa3d(6,6)
      real*8 d(*),ul(ndf,*),xl(ndm,*),tl(*),s(nst,nst),p(*)
      real*8 eg(3,9),wg(9),shp(ndm+1,nen),shpp(ndm+1,nen),
     &       dvol,detj
      real*8 alphaNM,betaNM,fa,fv
      real*8 hloc(180),hloc2(180),
     &       un(ndf,nen),vn(ndf,nen),an(ndf,nen),
     &       ut(ndf,nen),vt(ndf,nen),vn1(ndf,nen),an1(ndf,nen)
      real*8 sigp(10,14),pmat(4,4)
      real*8 xpS(3),xppS(3)
      real*8 LS(60,60),RS(60)
      real*8 It1,Jt2
      real*8 ShStElin(3,3),ShSlin(3,3),ShSLlin(3,3)
c      real*8 Iden4aTIden(3,3),IdenIden4a(3,3)         
c      real*8 bFtSinvnFtST12(3,3,3),FtSinvb(3)
      real*8 wtLS0StGThetahS
      logical errck,pinput
c     ----------------------------------------------------------------72
      if(isw.eq.1) then
c     ----------------------------------------------------------------72
c...  INPUT MATERIAL DATA
      ndoff    = 5
      ndele    = 6
c.... NUMBER OF HISTORY VARIABLES (ELEMENT)
      nhistele = 180      ! number of history variables (elements)
                          ! max [nel*(utS(3)+utSpS(3)+utSppS(3))] = 90
                          ! max [nel*(ThetapS(1)+ThetapS(1)+ThetappS(1))] = 30
                          ! max [nel*(nhS(1)+nhSpS(1)+nhSppS(1)] = 30
                          ! max [nel*(phLR(1)+phLRpS(1)+phLRppS(1)] = 30
      nd4      = 0        ! not used
      nd5      = 0        ! not used
      d(1) = ndoff
      d(2) = ndele
      d(3) = nhistele
      d(4) = nd4
      d(5) = nd5
      errck=pinput(d(ndoff+1),ndele)
      imatID = dint(d(ndoff+1))
      nd7    = dint(d(ndoff+2))
      isymm  = dint(d(ndoff+3))
      isymm  = 1                 ! always non-symmetric tangent
      d(ndoff+3) = isymm
      numtan = dint(d(ndoff+4))
      nd10   = dint(d(ndoff+5))
      nd11   = dint(d(ndoff+6))
      if (imatID.ne.05) then
      write(*,*) 'wrong material card ',imatID
      stop
      endif
      write(*,2000) ndoff,ndele,nhistele,nd4,nd5,imatID,nd7,isymm,
     &              numtan,nd10,nd11,ndm,ndf
      write(iow,2000) ndoff,ndele,nhistele,nd4,nd5,imatID,nd7,isymm,
     &                numtan,nd10,nd11,ndm,ndf

c...  READ MATERIAL PARAMETERS AND HISTORY INFORMATION
      call matlib_05(imatID,d,xg,f3d,f3ddot,g03d,g3d,s3d,aa3d,
     &               nhistmat,l,isw,numtan,nd10,nd11)

c...  ALLOCATION OF HISTORY VARIABLES PER ELEMENT
      mct = nhistele + nhistmat*4
      
c     ----------------------------------------------------------------72     
c     SET PLOT SEQUENCES
c     ----------------------------------------------------------------72
c...  2D
      if (nen.eq.4.or.nen.eq.8.or.nen.eq.10) then
      if (ndm.eq.2.and.nen.eq.4) then
      call plqud4(iel)                           !lin Quad 4-Node
      end if
      if (ndm.eq.2.and.nen.eq.8) then
      call plqud8(iel)                           !lin Quad 8-Node
      end if      
      if (ndm.eq.2.and.nen.eq.9) then
      call plqud8(iel)                           !lin Quad 8-Node
      end if      
c     ---      
c...  3D      
      if (ndm.eq.3.and.nen.eq.8) then
      call plbrk8(iel)                          !lin Brick 8-Node
      end if
      if (ndm.eq.3.and.nen.eq.10) then
      call pltet10(iel)                         !quad Tet 10-Node
      end if
c     ---      
      else
      write(*,*) 'wrong nen =',nen
      stop
      end if
      return            
c     ----------------------------------------------------------------72
      
      elseif(isw.eq.3.or.isw.eq.4.or.isw.eq.8) then
c     ----------------------------------------------------------------72
c...  BERECHNUNG DER STEIFIGKEITSMATRIX UND DES RESIDUUMS

c...  SET INITIAL CONTROL VALUES
      ndoff    = dint(d(1))          !number of general parameters
      ndele    = dint(d(2))          !number of element parameters
      nhistele = dint(d(3))
      imatID   = dint(d(ndoff+1))
      isymm    = dint(d(ndoff+3))
      numtan   = dint(d(ndoff+4))

      
c     ----------------------------------------------------------------72
c...  SET NUMBER OF GAUSS POINTS
c     ----------------------------------------------------------------72
c...  2D
      if (ndm.eq.2) then
c     ---      
      if (nen.eq.4) then             ! 4 Node Rectangle-linear
      lint = 4
      end if
      if (nen.eq.8) then             ! 8 Node Rectangle-linear
      lint = 9
      end if
      if (nen.eq.9) then             ! 9 Node Rectangle-linear
      lint = 9
      end if
c     ---
      end if
c     ----------------------------------------------------------------72     
c...  3D
      if (ndm.eq.3) then
c     ---
      if (nen.eq.8) then
      lint = 8                       ! 8 Node Brick, linear
      end if
      if (nen.eq.10) then
      lint = 4                       ! quad Tet 10-Nodes
      end if      
c     ---
      end if
c     ----------------------------------------------------------------72

c...  NEWMARK-PARAMETERS AND FACTORS
      alphaNM = 1.d0/4.d0
      betaNM  = 1.d0/2.d0
      fv = betaNM/alphaNM/dt
      fa = 1.d0/alphaNM/(dt*dt)

c...  MOVE DISPLACEMENTS, VELOCITIES AND ACCELERATIONS
      do i = 1,nhistele
      hloc(i) = hr(nh1+i-1)
      end do
      call pmove(hloc(1),un,ndf*nen)
      call pmove(hloc(1*ndf*nen+1),vn,ndf*nen)
      call pmove(hloc(2*ndf*nen+1),an,ndf*nen)

c...  VELOCITIES AND ACCELERTIONS AT TIME t_n+1
      do j = 1,nel
      do i = 1,ndf
      ut(i,j)  = un(i,j)+dt*vn(i,j)
     &                  +dt**2/2.d0*(1.d0-2.d0*alphaNM)*an(i,j)
      vt(i,j)  = vn(i,j)+dt*(1.d0-betaNM)*an(i,j)
      an1(i,j) = (ul(i,j)-ut(i,j))/(alphaNM*dt**2)
      vn1(i,j) = vt(i,j)+dt*betaNM*an1(i,j)
      end do
      end do

c...  GAUSS POINTS -- COORDINATES AND WEIGHTING FUNCTIONS
      call UPGauss_jbxx(ndm,nen,lint,eg,wg)

c     SET LEFT AND RIGHT SIDE ZERO
      do i = 1,ndf*nel
      p(i) = 0.d0
      do j = 1,ndf*nel
      s(i,j) = 0.d0
      end do
      end do

c...  START GAUSS LOOOP
      do l = 1,lint
     
c...  COMPUTE SHAPE FUNCTIONS AND CORRESPONDING DERIVATIVES
      call UPshpMetrik_jbxx(nen,eg(1,l),xl,ul,vn1,shp,shpp)
      dvol = detFref*wg(l)

c...  READ MATERIAL PARAMETERS AND HISTORY INFORMATION
      call matlib_05(imatID,d,xg,f3d,f3ddot,g03d,g3d,s3d,aa3d,
     &               nhistmat,l,isw,numtan,nd10,nd11)


c     ----------------------------------------------------------------72
c...  COMPUTE
c     ThetahS, ThetahSpS
c     nhS,nhSpS
c     phLR, phLRpS
c     xpS, xppS
c     GradThetahS
c     GradphLR
c     ----------------------------------------------------------------72
      ThetahS   = 0.0d0
      ThetahSpS = 0.0d0
      nhS       = 0.0d0
      nhSpS     = 0.0d0    
      phLR      = 0.0d0
      phLRpS    = 0.0d0
      call pzero(xpS,3)      
      call pzero(xppS,3)      
      call pzero(GradThetahS,3)
      call pzero(GradphLR,3)
c     ---
      if (idTH.gt.-0.01d0.and.idTH.lt.0.01d0) then    !Start no Taylor-Hood 
      do k = 1,nen                                    !Start k=1,nen
c...  ThetahS, ThetahSpS
      ThetahS   = ThetahS+(ThetahSt0+ul(ndm+1,k))*shp(ndm+1,k)     
      ThetahSpS = ThetahSpS+vn1(ndm+1,k)*shp(ndm+1,k)
c...  nhS, nhSpS
      nhS   = nhS+(nhSt0+ul(ndm+2,k))*shp(ndm+1,k)
      nhSpS = nhSpS+vn1(ndm+2,k)*shp(ndm+1,k)           
c...  phLR, phLRpS
      phLR   = phLR+(phLRt0+ul(ndm+3,k))*shp(ndm+1,k)
      phLRpS = phLRpS+vn1(ndm+3,k)*shp(ndm+1,k)
c...  xpS, xppS
      do i = 1,ndm
      xpS(i)  = xpS(i) +vn1(i,k)*shp(ndm+1,k)
      xppS(i) = xppS(i)+an1(i,k)*shp(ndm+1,k)
      end do
c...  GradThetahS
      do i = 1,ndm
      GradThetahS(i) =  GradThetahS(i)
     &                 +(ThetahSt0+ul(ndm+1,k))*shp(i,k)
      end do
c...  GradphLR
      do i = 1,ndm
      GradphLR(i) =  GradphLR(i)
     &              +(phLRt0+ul(ndm+3,k))*shp(i,k)    
      end do     
      end do                                          !End k=1,nen
      end if                                          !End no Taylor-Hood      
c     ---      
      if (idTH.gt.0.99d0.and.idTH.lt.1.01d0) then     !Start Taylor-Hood
      do k = 1,nen                                    !Start k=1,nen
c...  ThetahS, ThetahSpS
      ThetahS   = ThetahS+(ThetahSt0+ul(ndm+1,k))*shpp(ndm+1,k)     
      ThetahSpS = ThetahSpS+vn1(ndm+1,k)*shpp(ndm+1,k)
c...  nhS, nhSpS
      nhS   = nhS+(nhSt0+ul(ndm+2,k))*shpp(ndm+1,k)
      nhSpS = nhSpS+vn1(ndm+2,k)*shpp(ndm+1,k)           
c...  phLR, phLRpS
      phLR   = phLR+(phLRt0+ul(ndm+3,k))*shpp(ndm+1,k)
      phLRpS = phLRpS+vn1(ndm+3,k)*shpp(ndm+1,k)
c...  xpS, xppS
      do i = 1,ndm
      xpS(i)  = xpS(i) +vn1(i,k)*shp(ndm+1,k)
      xppS(i) = xppS(i)+an1(i,k)*shp(ndm+1,k)
      end do
c...  GradThetahS
      do i = 1,ndm
      GradThetahS(i) =  GradThetahS(i)
     &                 +(ThetahSt0+ul(ndm+1,k))*shpp(i,k)
      end do
c...  GradphLR
      do i = 1,ndm
      GradphLR(i) =  GradphLR(i)
     &              +(phLRt0+ul(ndm+3,k))*shpp(i,k)    
      end do     
      end do                                          !End k=1,nen
      end if                                          !End Taylor-Hood 
c     ----------------------------------------------------------------72


c     ----------------------------------------------------------------72
c...  COMPUTE SCALAR QUANTITIES
c     nhS, nhL, nhLpS, nhLt0S
c     rhohSt0, rhohSR, rhohS, rhohSpS
c     rhohLt0, rhohLR, rhohLRt0S, rhohL, rhohLt0S, rhohLpS
c     ----------------------------------------------------------------72
c     VOLUME FRACTIONS
      nhS       = nhSt0/JtS
      nhL       = 1.0d0-nhS
      nhLpS     = -nhSpS
      nhLt0S    = nhL*JtS
c     ---      
C     DENSITIES SOLID
      rhohSt0   = nhSt0*rhohSRt0
      rhohSR    = rhohSRt0
      rhohS     = nhS*rhohSR
      rhohSpS   = nhSpS*rhohSR
c     ---      
c     DENSITIES LIQUID
      rhohLt0   = nhLt0*rhohLRt0
      rhohLR    = rhohLRt0
      rhohLRt0S = rhohLR*JtS
      rhohL     = nhL*rhohLR
      rhohLt0S  = rhohL*JtS
      rhohLpS   = nhLpS*rhohLR
c     ----------------------------------------------------------------72


c     ----------------------------------------------------------------72
c...  Compute Mechanical and Electrical Invariants
c     ----------------------------------------------------------------72
c     It1 = trEtSlin
      It1 = trEtSlin
c     ----------------------------------------------------------------72

c     ----------------------------------------------------------------72
c...  COMPUTE SCALAR EXPRESSIONS
c     ----------------------------------------------------------------72
c     EtSpStCtSinv = EtSpS**CtSinv
      EtSpStCtSinv = 0.0d0
      do ii = 1,3
      do ik = 1,3
      EtSpStCtSinv = EtSpStCtSinv+EtSpS(ii,ik)*CtSinv(ii,ik)
      end do
      end do
c     ----------------------------------------------------------------72


c     ----------------------------------------------------------------72
c...  COMPUTE VECTOR EXPRESSIONS
c     ----------------------------------------------------------------72
      wtLS0StGThetahS = 0.0d0
      do ii = 1,3
      wtLS0StGThetahS = wtLS0StGThetahS+wtLS0S(ii)*GradThetahS(ii)
      end do
c     ----------------------------------------------------------------72


c     ----------------------------------------------------------------72
c...  Compute Fundamental Tensors
c...  Compure Derivations 1
c...  Compute Derivations 2
c     ----------------------------------------------------------------72
      call UPAbleitung_jbxx(dt)
c     ----------------------------------------------------------------72




c     ----------------------------------------------------------------72
c     BaMoMi -- Balance Momentum Mixture
c...  COMPUTE MATERIAL TENSORS
c     B4EtSlin  = dsigma(tensor)/dEtSlin
c     B4FtS     = dsigma(tensor)/dFtS
c               = B4EtSlin 1/2 [(I#I)^T23 + (I#I)^T24 ]
c     B2ThetahS = dsigma(tensor)/dThethahS
c     B2phLR    = dsigma(tensor)/dphLR
c     B2utS     = dBaMoMi(vector)/dutS
c     ----------------------------------------------------------------72
      do ii = 1,3
      do ik = 1,3
      do io = 1,3
      do ip = 1,3
      B4EtSlin(ii,ik,io,ip) =
     &        2.0d0*(muhS+muhSvis*2.0d0/dt)*Iden(ii,io)*Iden(ik,ip)
     &       +(lambdahS+lambdahSvis*2.0d0/dt)*Iden(ii,ik)*Iden(io,ip)
      end do
      end do
      end do
      end do
      do ii = 1,3
      do ik = 1,3
      do ir = 1,3
      do is = 1,3
      B4FtS(ii,ik,ir,is) =  0.0d0    
      do io = 1,3
      do ip = 1,3
      B4FtS(ii,ik,ir,is) =  B4FtS(ii,ik,ir,is)
     &                    +B4EtSlin(ii,ik,io,ip)*EtSlinnFtS(io,ip,ir,is)  
      end do
      end do
      end do
      end do
      end do 
      end do
c     ---
      do ii = 1,3
      do ik = 1,3
      do io = 1,3
      B3FtS(ii,ik,io) = -b(ii)*rhohLt0SnFtS(ik,io)
      end do
      end do
      end do
c     ---
      do ii = 1,3
      do ik = 1,3
      B2ThetahS(ii,ik) = -3.0d0*alphahStT*komphS*Iden(ii,ik)
      end do
      end do
c     ---
      do ii = 1,3
      do ik = 1,3
      B2phLR(ii,ik) = -Iden(ii,ik)
      end do 
      end do
c     ---
      do ii = 1,3
      do ik = 1,3
      B2utS(ii,ik) = fdynS*rhohSt0*4.0d0/dt**2*Iden(ii,ik)
      end do
      end do      
c     ----------------------------------------------------------------72      


c     ----------------------------------------------------------------72
c     BaEnMi -- Balance Energy Mixture
c...  COMPUTE MATERIAL TENSORS
c     C2GThetahS = dBaEnMi(vector)/dGradThetahS
c     C1GThetahS = dBaEnMi(scalar)/dGradThetahS
c     C3FtS      = dBaEnMi(vector)/dFtS
c     C2FtS      = dBaEnMi(scalar)/dFtS
c     C0ThetahS  = dBaEnMi(scalar)/dThetahS
c     ----------------------------------------------------------------72
      do ii = 1,3
      do ik = 1,3
      C2GThetahS(ii,ik) = qhSLt0SnGThetahS(ii,ik)
      end do
      end do
c     ---
      do ii = 1,3
      C1GThetahS(ii) = -rhohL*chL*wtLS0S(ii) 
      end do
c     ---
      do ii = 1,3
      do ik = 1,3
      do io = 1,3
      C3FtS = qhSLt0SnFtS(ii,ik,io)
      end do
      end do
      end do
c     ---
      do ii = 1,3
      do ik = 1,3
      C2FtS(ii,ik) = -chL*ThetahSpS*rhohLt0SnFtS(ii,ik)
     &               -fBaEnMi*3.0d0*ThetahS*alphahStT*komphS
     &                *EtSpStCtSinvanFtS(ii,ik)
     &               -chL*wtLS0StGThetahS*rhohLnFtS(ii,ik)
      end do
      end do
      do ii = 1,3
      do ik = 1,3
      do io = 1,3
      C2FtS(ii,ik) =  C2FtS(ii,ik)
     &               -rhohL*chL*GradThetahS(io)*wtLS0SnFtS(io,ii,ik)
      end do
      end do
      end do      
c     ---
      C0ThetahS = -(rhohSt0*chS+rhohLt0S*chL)*2.0d0/dt
     &            -fBaEnMi*3.0d0*alphahstT*komphS*EtSpStCtSinv     
c     ----------------------------------------------------------------72

      
c     ----------------------------------------------------------------72
c     BaMaSo -- Balance Mass Solid
c...  COMPUTE MATERIAL TENSORS
c     D2FtS   = dBaMaSo(scalar)/dFtS
c     D0nhS   = dBaMaSo(scalar)/dnhS
c     ----------------------------------------------------------------72      
      do ii = 1,3
      do ik = 1,3
      D2FtS(ii,ik) =  nhSpS*JtSnFtS(ii,ik)
     &               +nhSt0*EtSpStCtSinvanFtS(ii,ik)
      end do
      end do
c     ---
      D0nhS = JtS*2.0d0/dt      
c     ----------------------------------------------------------------72



c     ----------------------------------------------------------------72
c     SaCoMi -- Saturation Condition Mixture
c...  COMPUTE MATERIAL TENSORS
c     E3FtS   = dSaCoMi(vector)/dFtS
c     E2FtS   = dSaCoMi(scalar)/dFtS
c     E2GphLR = dSaCoMi(vector)/dGradphLR
c     ----------------------------------------------------------------72      
      do ii = 1,3
      do ik = 1,3
      do io = 1,3
      E3FtS(ii,ik,io) =  nhL*wtLS0SnFtS(ii,ik,io)
     &                  +wtLS0S(ii)*nhLnFtS(ik,io)
      end do
      end do
      end do
c     ---
      do ii = 1,3
      do ik = 1,3
      E2FtS(ii,ik) = -JtS*EtSpStCtSinvanFtS(ii,ik)
     &               -EtSpStCtSinv*JtSnFtS(ii,ik)
      end do
      end do
c     ---
      do ii =1,3
      do ik =1,3
      E2GphLR(ii,ik) = nhL*wtLS0SnGphLR(ii,ik)
      end do
      end do
c     ----------------------------------------------------------------72




c     ----------------------------------------------------------------72      
c...  COMPUTE STRESSES
c     ShStElin
c     ShSlin
c     ShSLlin
c     ----------------------------------------------------------------72
      do ii = 1,3
      do ik = 1,3
      ShStElin(ii,ik) =  2.0d0*muhS*EtSlin(ii,ik)
     &                  +lambdahS*trEtSlin*Iden(ii,ik)
     &                  +2.0d0*muhSvis*EtSlinpS(ii,ik)
     &                  +lambdahSvis*trEtSlinpS*Iden(ii,ik)
      end do
      end do
c     ---      
      do ii = 1,3
      do ik = 1,3
      ShStElin(ii,ik) = ShStElin(ii,ik)
     &        -3.0d0*alphahStT*komphS*(ThetahS-ThetahSt0)*Iden(ii,ik)
      end do
      end do
c     ---
      do ii = 1,3
      do ik = 1,3
      ShSLlin(ii,ik) = ShStElin(ii,ik)-(phLR-phLRt0)*Iden(ii,ik)      
      end do
      end do     
c     ----------------------------------------------------------------72

c     ----------------------------------------------------------------72      
c...  COMPUTE HEATFLUX VECTOR
c     qhSLt0S
c     ----------------------------------------------------------------72
      do ii = 1,3
      qhSLt0S(ii) = 0.0d0
      do ik = 1,3
      qhSLt0S(ii) =  qhSLt0S(ii)
     &              -JtS*alphahSLtq*CtSinv(ii,ik)*GradThetahS(ik)
      end do
      end do
c     ----------------------------------------------------------------72


c     ----------------------------------------------------------------72      
c...  COMPUTE DIFFERENCE VELOCITIES
c     wtLS0S
c     ----------------------------------------------------------------72
      do ii = 1,3
      wtLS0S(ii) = 0.0d0
      do ik = 1,3
      wtLS0S(ii) =  wtLS0S(ii)
     &             -khLDarcy*JtS*CtSinv(ii,ik)*GradphLR(ik)
     &             +khLDarcy*JtS*rhohLR*FtSinv(ii,ik)*b(ik)
      end do
      end do
c     ----------------------------------------------------------------72


c     ----------------------------------------------------------------72
c...  CONSTRUCTION RIGHT SIDES (WEAK FORMS)
c     RSBaMoMi2, RSBaMoMi1
c     RSBaEnMi1, RSBaEnMi0
c     RSBaMaSo0
c     RSSaCoMi1, RSSaCoMi0
c     ----------------------------------------------------------------72
      do ii = 1,3
      do ik = 1,3
      RSBaMoMi2(ii,ik) = ShSLlin(ii,ik)
      end do
      end do
c     ---      
      do ii = 1,3
      RSBaMoMi1(ii) =  fdynS*rhohSt0*xppS(ii)
     &                -rhohSt0*b(ii)-rhohLt0S*b(ii)
      end do
c     ---
      do ii = 1,3
      RSBaEnMi1(ii) = qhSLt0S(ii)
      end do
c     ---      
      RSBaEnMi0 = -(rhohSt0*chS+rhohLt0S*chL)*ThetahSpS
     &            -fBaEnMi*3.0d0*ThetahS*alphahStT*komphS*EtSpStCtSinv
     &            -rhohL*chL*wtLS0StGThetahS
c     ---
      RSBaMaSo0 = JtS*nhSpS+nhSt0*EtSpStCtSinv
c     ---
      do ii = 1,3
      RSSaCoMi1(ii) = nhL*wtLS0S(ii)
      end do
c     ---      
      RSSaCoMi0 = -JtS*EtSpStCtSinv
c     ----------------------------------------------------------------72


c     ----------------------------------------------------------------72
c...  MOVE LOCAL STRESSES FOR PRINTING/PLOTTING
      if(isw.eq.4.or.isw.eq.8) then
c...  STRESSES 11, 22, 33, 12
      sigp(1,l) = ShSLlin(1,1)
      sigp(2,l) = ShSLlin(2,2)
      sigp(3,l) = ShSLlin(3,3)
      sigp(4,l) = ShSLlin(1,2) 
c...  DISPLACEMENTS, VELOCITIES AND ACCELRATIONS
      sigp(5,l)  = 0.0d0 ! Verschiebungen 1-Richtung
      sigp(6,l)  = JtS ! Verschiebungen 2-Richtung
c...  TEMPERATURE, DENSITY SOLID, JACOBIAN SOLID
      sigp(7,l)  = ThetahS
      sigp(8,l)  = rhohS
      sigp(9,l)  = phLR
      sigp(10,l) = wtLS0S(2)
      !sigp(11,l) = xpS(2)
      !sigp(12,l) = EtSpStCtSinv
      
c     ----------------------------------------------------------------72
c...  OUTPUT STRESSES
c     ----------------------------------------------------------------72
      if(isw.eq.4) then
      mct = mct - 2
      if(mct.le.0) then
      write(iow,2001) o,head
      if(ior.lt.0) write(*,2001) o,head
      mct = 50
      end if
      write(iow,2002) n,ma,l,(sigp(i,l),i=1,4)
      write(*,2002)   n,ma,l,(sigp(i,l),i=1,4)
c     ----------------------------------------------------------------72


c     ----------------------------------------------------------------72
c...  COMPUTE NODAL STRESSES
c     ----------------------------------------------------------------72
      elseif (isw.eq.8) then
c     ---      
c     2D  
      if (ndm.eq.2) then
c     ---
      if (nen.eq.4) then
      call smooak05(shp,nel,l,lint,xl,pmat)
      if(l.eq.lint) then
      istb = 1
      iste = 10
      call stcn05(numnp,nel,lint,xl,ix,sigp,
     &            hr(nph),hr(nph+numnp),pmat,istb,iste)
      end if
      end if
c     ---
      if (nen.eq.8.or.nen.eq.9) then 
      call stcn05_a(numnp,nen,lint,xl,ix,sigp,hr(nph),
     &              hr(nph+numnp),pmat,istb,iste,shp,dvol,l)
      end if
c     ---
      end if
c     ---
c     3D
      if (ndm.eq.3) then
      if (nen.eq.8.or.nen.eq.10) then
      istb = 1
      iste = 24
      call stcn05_3D(nen,ix,shp(1,1),dvol,sigp(1,l),numnp,
     &               hr(nph),hr(nph+numnp))
      end if
      end if
c     ---
      end if                                           !End isw = 4
c     ----------------------------------------------------------------72     
 
      elseif (isw.eq.3) then    

c     ----------------------------------------------------------------72
c     COMPUTE LEFT AND RIGHT SIDE
c     ----------------------------------------------------------------72
c...  2D
      if (ndm.eq.2) then                              !Start ndm = 2
c     ---
      if (nen.eq.4) then                              !Start nen = 4
      call UP_LS05_2DQua45(
     #        LS,shp,ndm,nel,dt)
      call UP_RS05_2DQua45(
     #        RS,shp,ndm,nel)
      do i = 1,ndf*nel
      p(i) = p(i) + RS(i)*dvol
      do k = 1,ndf*nel
      s(i,k) = s(i,k) + LS(i,k)*dvol
      end do
      end do
      end if                                          !End nen = 4
c     ---
      if (nen.eq.8) then                              !Start nen = 8
      if (idTH.gt.-0.01d0.and.idTH.lt.0.01d0) then    !Start no Taylor-Hood
      call UP_LS05_2DQua85(
     #        LS,shp,ndm,nel,dt)
      call UP_RS05_2DQua85(
     #        RS,shp,ndm,nel)     
      do i = 1,ndf*nel
      p(i) = p(i) + RS(i)*dvol
      do k = 1,ndf*nel
      s(i,k) = s(i,k) + LS(i,k)*dvol
      end do
      end do
      end if                                          !End  no Taylor-Hood
      end if                                          !End nen = 8
c     ---
      if (nen.eq.8) then                              !Start nen = 8
      if (idTH.gt.0.99d0.and.idTH.lt.1.01d0) then     !Start Taylor-Hood
      call UP_LS05_2DQua85TH(
     #        LS,shp,shpp,ndm,nel,dt)
      call UP_RS05_2DQua85TH(
     #        RS,shp,shpp,ndm,nel)
      do i = 1,ndf*nel
      p(i) = p(i) + RS(i)*dvol
      do k = 1,ndf*nel
      s(i,k) = s(i,k) + LS(i,k)*dvol
      end do
      end do
      s(23,23) = 1.0d0
      s(24,24) = 1.0d0      
      s(25,25) = 1.0d0
      s(28,28) = 1.0d0
      s(29,29) = 1.0d0      
      s(30,30) = 1.0d0 
      s(33,33) = 1.0d0  
      s(34,34) = 1.0d0      
      s(35,35) = 1.0d0      
      s(38,38) = 1.0d0
      s(39,39) = 1.0d0      
      s(40,40) = 1.0d0
      end if                                          !End Taylor-Hood     
      end if                                          !End nen = 8     
c     ---
      end if                                          !End ndm = 2
c     ----------------------------------------------------------------72
c...  3D
      if (ndm.eq.3) then                              !Start ndm = 3
c     ---
      if (nen.eq.8) then                              !Start nen = 8
c      call UP_L05_3DBri86(
c     #        LS,shp,ndm,nel,dt)
c      call UP_RS05_3DBri86(
c     #        RS,shp,ndm,nel)
c      do i = 1,ndf*nel
c      p(i) = p(i) + RS(i)*dvol
c      do k = 1,ndf*nel
c      s(i,k) = s(i,k) + LS(i,k)*dvol    
c      end do
c      end do
      write(*,*) 'wrong element: nen = 8, ndm  = 3'
      end if                                          !End nen = 8
c     ---      
      if (nen.eq.10) then                             !Start nen = 10
c      call UP_L05_3DTet106(
c     #        LS,shp,ndm,nel,dt)
c      call UP_RS05_3DTet106(
c     #        RS,shp,ndm,nel)
c      do i = 1,ndf*nel
c      p(i) = p(i) + RS(i)*dvol
c      do k = 1,ndf*nel
c      s(i,k) = s(i,k) + LS(i,k)*dvol
c      end do
c      end do     
      write(*,*) 'wrong element: nen = 10, ndm  = 3'
      end if                                          !End nen = 10      
c     ---      
      end if                                          !End ndm = 3      
c     ----------------------------------------------------------------72


c     ----------------------------------------------------------------72
      end if    ! isw 4/8
      end do    ! End Gauss loop
c     ----------------------------------------------------------------72

      if(isw.eq.3) then   ! isw = 3

c...  MOVE HISTORY FILED
      call pmove(ul ,hloc2(1) ,ndf*nen)
      call pmove(vn1,hloc2(ndf*nen+1),ndf*nen)
      call pmove(an1,hloc2(2*ndf*nen+1),ndf*nen)

      do i = 1,nhistele
      hr(nh2+i-1) = hloc2(i)
      end do
      end if ! isw 3


      if (isw.eq.3.and.n.eq.0) then
      call mprint(p,nst,1,nst,'p')
      call mprint(s,nst,nst,nst,'s')
      end if
      if (isw.eq.3.and.n.eq.0) then
      call mprint(p,nst,1,nst,'p')
      call mprint(s,nst,nst,nst,'s')
      end if
      
      end if    ! isw 1 3 4 8
      return

c     ----------------------------------------------------------------72
c...  FORMATS FOR INPUT-OUTPUT
c     ----------------------------------------------------------------72
 2000 format(
     & 3x,'*****************************************************',/
     & 3x,'FEAP_elmt05_TPM_2P_linelas_141017.txt                ',/
     & 3X,'2-Phase-Model, thermo-mechanical material behavior   ',/
     & 3X,'Solid:  incompressible, linear thermo-visco-elastic  ',/
     & 3X,'Liquid: incompressible                               ',/
     & 3X,'System of equations: BaMoMi - Mixture                ',/
     & 3X,'                     BaEnMi - Mixture                ',/
     & 3X,'                     BaMaSo - Solid                  ',/
     & 3X,'                     SaCoMi - Mixture                ',/
     & 3x,'Degrees of freedom:  utS, ThetahS, nhS, phlR         ',/
     & 3x,'ELEMENTS:                                            ',/
     & 3x,'2D Plane-Strain-Element: 4, 8 Nodes - 45, 85         ',/
     & 3x,'2D Plane-Strain-Element: 8/4 Nodes,                  ',/
     & 3x,'                         Taylor Hood - 85TH          ',/
     & 3x,'3D Brick-Element: 8 Nodes - 86                       ',/
     & 3x,'3D Tetrahedron-Element: 10 Nodes - 106               ',/     
     & 3x,'       (c) Institut fuer Mechanik, Uni-DUISBURG-ESSEN',/
     & 3x,'*****************************************************',/
     & 3x,'[ 1] [   ndoff] number of general parameters.........',i12/
     & 3x,'[ 2] [   ndele] number of element parameters.........',i12/
     & 3x,'[ 3] [nhistele] number of element history variables..',i12/
     & 3x,'[ 4] [     nd4] not used.... ........................',i12/
     & 3x,'[ 5] [     nd5] not used.... ........................',i12/
     & 3x,'[ 6] [  imatID] number of material model.............',i12/
     & 3x,'[ 7] [     nd7] not used.... ........................',i12/
     & 3x,'[ 8] [   isymm] 0-symmetric, 1-non-symmetric tangent.',i12/
     & 3x,'[ 9] [  numtan] 0-analytical, 1-numerical tangent....',i12/
     & 3x,'[10] [    nd10] not used for small strains...........',i12/
     & 3x,'[11] [    nd11] not used.............................',i12/
     & 3x,'[12] [     ndm] Dimension............................',i12/
     & 3x,'[13] [     ndf] Nodal Degree of Freedom..............',i12/)
 2001  format(a1,20a4/'     element stresses'/'      elmt matl  gpt',
     1 ' 11-stress    22-stress    33-stress    12-stress          ')
 2002  format(5x,3i5,4e11.4)
c     ----------------------------------------------------------------72
      end
