c     ****************************************************************72
      subroutine matlib_05(imatID,d,xg,f3d,f3ddot,g03d,g3d,s3d,aa3d,
     &                     nhistmat,l,isw,numtan,nd10,nd11)
c     ****************************************************************72
c     ################################################################72
c     Material Controle File
c     symmetric profil   : 11,22,33,12,23,13
c...  INPUTS
c     d(*)      : material parameters 
c     xg(3)     : Koordinaten vom Gausspunkt
c     f3d(3,3)  : deformation gradient
c     g03d(6)   : Metrik Referenzkonfiguration
c     g3d(6)    : Metrik Momentankonfiguration

c     nhistele  : History Variablen vom Element
c     l         : Gausspunkt
c     isw       : Steuerparameter
c     nd11      : not used
c     ################################################################72
      implicit none
      integer imatID,nhistmat,l,isw,numtan,nd10,nd11
      integer ndoff,ndele,nhistele,ndpa
      real*8 d(*)
      real*8 xg(3),f3d(3,3),f3ddot(3,3),
     &       g03d(6),g3d(6),s3d(24),aa3d(6,6)
c     ----------------------------------------------------------------72

      ndoff    = dint(d(1))
      ndele    = dint(d(2))
      nhistele = dint(d(3))
      ndpa = ndoff + ndele

      call pzero(aa3d,6*6)
      call pzero(s3d,24)

      if(imatID.eq.05)
     &call mate_05(d(ndpa+1),xg,f3d,f3ddot,g03d,g3d,s3d,aa3d,
     &             nhistmat,nhistele,l,isw,numtan,nd10,nd11)

      return
      end

c     ****************************************************************72



c     ****************************************************************72
      subroutine mate_05(d,xg,f3d,f3ddot,g03d,g3d,s3d,aa3d,
     &                   nhistmat,nhistele,l,isw,nd9,nd10,nd11)
c     ****************************************************************72
c     Material Routine
c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      include  'iofile.h'
      include  'eldata.h'
      include  'tdata.h'
c     ----------------------------------------------------------------72      
      include   'xDatB_jbxx.h'
      include   'xDatMaPa_jbxx.h'
c     ----------------------------------------------------------------72
      integer nhistmat,nhistele,l,isw,nd9,nd10,nd11
      integer izaehl(3)
      real*8 d(*)  
      real*8 xg(3),f3d(3,3),f3ddot(3,3),
     &       g03d(6),g3d(6),s3d(24),aa3d(6,6)
      logical errck,pinput
      data izaehl/1,12,20/
c---------------------------------------------------------------------72
c...  SET IDENTIFIER FOR ELEMENT ROUTINE
      nhistmat = 0
      if(isw.eq.1) then
      errck=pinput(d(1),4)
      errck=pinput(d(5),5)
      errck=pinput(d(10),2)
      errck=pinput(d(12),4)
      errck=pinput(d(16),4)
      errck=pinput(d(20),5)
      write(*,2001)   nhistmat,d(izaehl(1)),d(izaehl(1)+1),
     &                         d(izaehl(1)+2),d(izaehl(1)+3),
     &                         d(izaehl(1)+4),d(izaehl(1)+5),
     &                         d(izaehl(1)+6),d(izaehl(1)+7),
     &                         d(izaehl(1)+8),d(izaehl(1)+9),
     &                         d(izaehl(1)+10)
      write(iow,2001) nhistmat,d(izaehl(1)),d(izaehl(1)+1),
     &                         d(izaehl(1)+2),d(izaehl(1)+3),
     &                         d(izaehl(1)+4),d(izaehl(1)+5),
     &                         d(izaehl(1)+6),d(izaehl(1)+7),
     &                         d(izaehl(1)+8),d(izaehl(1)+9),
     &                         d(izaehl(1)+10)
      write(*,2002)            d(izaehl(2)),d(izaehl(2)+1),
     &                         d(izaehl(2)+2),d(izaehl(2)+3),
     &                         d(izaehl(2)+4),d(izaehl(2)+5),
     &                         d(izaehl(2)+6),d(izaehl(2)+7)          
      write(iow,2002)          d(izaehl(2)),d(izaehl(2)+1),
     &                         d(izaehl(2)+2),d(izaehl(2)+3),
     &                         d(izaehl(2)+4),d(izaehl(2)+5),
     &                         d(izaehl(2)+6),d(izaehl(2)+7)
      write(*,2003)            d(izaehl(3)),d(izaehl(3)+1),
     &                         d(izaehl(3)+2),d(izaehl(3)+3),
     &                         d(izaehl(3)+4)
      write(iow,2003)          d(izaehl(3)),d(izaehl(3)+1),
     &                         d(izaehl(3)+2),d(izaehl(3)+3),
     &                         d(izaehl(3)+4)
          
c...  MATERIAL PARAMETERS AND REFERENCE QUANTITIES SOLID PHASE
      EmodhS      = d(izaehl(1))
      nuhS        = d(izaehl(1)+1)
      muhSvis     = d(izaehl(1)+2)
      lambdahSvis = d(izaehl(1)+3)
      alphahStT   = d(izaehl(1)+4)
      alphahStq   = d(izaehl(1)+5)
      chS         = d(izaehl(1)+6)
      ThetahSt0   = d(izaehl(1)+7)
      fBaEnMi     = d(izaehl(1)+8)
      nhSt0       = d(izaehl(1)+9)
      rhohSRt0    = d(izaehl(1)+10)
c...  MATERIAL PARAMETERS AND REFERENCE QUANTITIES LIQUID PHASE      
      alphahLtT  = d(izaehl(2))
      alphahLtq  = d(izaehl(2)+1)
      chL        = d(izaehl(2)+2)
      ThetahLt0  = d(izaehl(2)+3)      
      nhLt0      = d(izaehl(2)+4)
      rhohLRt0   = d(izaehl(2)+5)
      phLRt0     = d(izaehl(2)+6)
      khLDarcy   = d(izaehl(2)+7)
c...  GENERAL MATERIAL PARAMETERS AND REFERENCE QUANTITIES        
      b(1)       = d(izaehl(3))
      b(2)       = d(izaehl(3)+1)
      b(3)       = d(izaehl(3)+2)
      fdynS      = d(izaehl(3)+3)
      idTH       = d(izaehl(3)+4) 
c...  CALCULATED MATERIAL PARAMETERS AND REFERENCE QUANTITIES      
      muhS       = EmodhS/2.0d0/(1.0d0+nuhS)
      lambdahS   = EmodhS*nuhS/(1.0d0+nuhS)/(1.0d0-2.0d0*nuhS)
      komphS     = 2.0d0/3.0d0*muhS+lambdahS
      alphahSLtq = alphahStq+alphahLtq

      else
c     ----------------------------------------------------------------72

c...  MATERIAL PARAMETERS AND REFERENCE QUANTITIES SOLID PHASE
      EmodhS      = d(izaehl(1))
      nuhS        = d(izaehl(1)+1)
      muhSvis     = d(izaehl(1)+2)
      lambdahSvis = d(izaehl(1)+3)
      alphahStT   = d(izaehl(1)+4)
      alphahStq   = d(izaehl(1)+5)
      chS         = d(izaehl(1)+6)
      ThetahSt0   = d(izaehl(1)+7)
      fBaEnMi     = d(izaehl(1)+8)
      nhSt0       = d(izaehl(1)+9)
      rhohSRt0    = d(izaehl(1)+10)
c...  MATERIAL PARAMETERS AND REFERENCE QUANTITIES LIQUID PHASE      
      alphahLtT  = d(izaehl(2))
      alphahLtq  = d(izaehl(2)+1)
      chL        = d(izaehl(2)+2)
      ThetahLt0  = d(izaehl(2)+3)      
      nhLt0      = d(izaehl(2)+4)
      rhohLRt0   = d(izaehl(2)+5)
      phLRt0     = d(izaehl(2)+6)
      khLDarcy   = d(izaehl(2)+7)
c...  GENERAL MATERIAL PARAMETERS AND REFERENCE QUANTITIES        
      b(1)       = d(izaehl(3))
      b(2)       = d(izaehl(3)+1)
      b(3)       = d(izaehl(3)+2)
      fdynS      = d(izaehl(3)+3)
      idTH       = d(izaehl(3)+4)      
c...  CALCULATED MATERIAL PARAMETERS AND REFERENCE QUANTITIES      
      muhS       = EmodhS/2.0d0/(1.0d0+nuhS)
      lambdahS   = EmodhS*nuhS/(1.0d0+nuhS)/(1.0d0-2.0d0*nuhS)
      komphS     = 2.0d0/3.0d0*muhS+lambdahS
      alphahSLtq = alphahStq+alphahLtq
      
c     ----------------------------------------------------------------72
      endif
c
      return
     
2001  format(/
     &3x,'Mate05-SOLID PHASE (LINEAR THERMO-VISCO-ELASIC,........... '/
     &3x,'                     INCOMPRESSIBLE).......................:'/    
     &3x,'[  ] [       nhistmat] # of material history variables',i6/     
     &3x,'[ 1] [         EmodhS] Young`s Modulus................',e12.5/
     &3x,'[ 2] [           nuhS] Poisson`s Ratio................',e12.5/
     &3x,'[ 3] [        muhSvis] Viscosity Constant 1 (damping).',e12.5/
     &3x,'[ 4] [    lambdahSvis] Viscosity Constant 2...........',e12.5/
     &3x,'[ 5] [       alphahST] Thermal expansion coeff........',e12.5/
     &3x,'[ 6] [       alphahSq] thermal conductivity...........',e12.5/
     &3x,'[ 7] [            chS] heat capacity coefficient......',e12.5/
     &3x,'[ 8] [      ThetahSt0] reference temperatur...........',e12.5/
     &3x,'[ 9] [        fBaEnMi] factor BaEnMi 0/1 dup*vTheta...',e12.5/         
     &3x,'[10] [          nhSt0] volume fraction................',e12.5/     
     &3x,'[11] [       rhohSRt0] real reference density.........',e12.5)      
         
2002  format(/
     &3x,'Mate_05-LIQUID PHASE (INCOMPRESSIBLE)......................:'/
     &3x,'[12] [       alphahLT] Thermal expansion coeff........',e12.5/
     &3x,'[13] [       alphahLq] thermal conductivity...........',e12.5/
     &3x,'[14] [            chL] heat capacity coefficient......',e12.5/
     &3x,'[15] [      ThetahLt0] reference temperatur...........',e12.5/
     &3x,'[16] [          nhLt0] volume fraction................',e12.5/  
     &3x,'[17] [       rhohLRt0] real reference density.........',e12.5/
     &3x,'[18] [         phLRt0] initial pressure Liquid........',e12.5/ 
     &3x,'[19] [       khLDarcy] Darcy parameter................',e12.5) 

2003  format(/
     &3x,'Mate_05-GENERAL VALUES AND PARAMETERS......................:'/
     &3x,'[20] [             b1] gravity 1-direction............',e12.5/
     &3x,'[21] [             b2] gravity 2-direction............',e12.5/
     &3x,'[22] [             b3] gravity 3-direction............',e12.5/
     &3x,'[23] [          fdynS] factor dynamic 0/1 (Solid).....',e12.5/
     &3x,'[24] [           idTH] identifyer TaylorHood 0/1......',e12.5)
c     
      end
c     ****************************************************************72



c     ****************************************************************72
      subroutine smooak05(shp,nel,l,lint,xl,p)
c     ****************************************************************72
c     Glaettung der Spannungen
c     Paramater
c         shp(3,nel)  Ansatzfunktionen
c         nel         Knotenanzahl der Elemente
c         l           Gausspunkt
c         lint        Anzahl der Gausspunkt
c         xl(2,*)     Knotenkoordinaten
c         p(4,4)      Smoothing Matrix
c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      integer nel,l,i,lint
      real*8 shp(3,nel),xl(2,*),p(4,4)
      real*8 gx,gy
c     ----------------------------------------------------------------72

c...  COMPUTE P MATRIX FOR ERROR INTERPOLATION
c     ----------------------------------------------------------------72

        if (lint.eq.4) then
c...  COMPUTE GLOBAL COORDINATES OF GAUSS POINTS
        gx = 0.d0
        gy = 0.d0
        do i=1,nel
        gx = gx + shp(3,i)*xl(1,i)
        gy = gy + shp(3,i)*xl(2,i)
        end do
        p(l,1) = gx
        p(l,2) = gy
        p(l,3) = gx*gy
        p(l,4) = 1.d0
        endif
c     ----------------------------------------------------------------72
      end
c     ****************************************************************72



c     ****************************************************************72
      subroutine stcn05(numnp,nel,lint,xl,ix,sigp,
     &                  dt,st,pmat,istb,iste)
c     ****************************************************************72
c     Berechnung der Spannungen an den Knoten
c     Parameter
c         numnp         Anzahl der Knoten des Systems
c         nel           Anzahl der Elementknoten
c         lint          Anzahl der Gausspunkte
c         xl(2,*)       Knotenkoordinaten   
c         ix(*)         Knotennummerierung
c         sigp(4,*)    Projektionen fuer Plotausgabe 
c         st(numnp,*)   Projizierte Daten
c         dt(*)         Wichtungskoeffizienten 
c         pmat(4,4)     Koeffizientenmatrix
c         istb,iste     ID fuer Projektionsfeld
c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      integer numnp,nel,lint,ix(*),i,j,k,iste,istb
      real*8 xl(2,*), sigp(10,*),st(numnp,*),dt(numnp),pmat(4,4)
      real*8 xmat(4,4),xpmat(4,4),xpm
c     ----------------------------------------------------------------72

c...  COMPUTE NODAL STRESSES
c     ----------------------------------------------------------------72

c...  FOR QUADS WITH 4 GAUSS POINTS
      if (lint.eq.4) then
        call invert(pmat,4,4)
        do i=1, nel
          xmat(i,1) = xl(1,i)
          xmat(i,2) = xl(2,i)
          xmat(i,3) = xl(1,i)*xl(2,i)
          xmat(i,4) = 1.d0
        end do
      endif
c
c...  PROJECTION
      do i=1, nel
        do j=1, lint
          xpm = 0.d0
          do k=1,lint
            xpm = xpm + xmat(i,k)*pmat(k,j)
          end do
          xpmat(i,j) = xpm

         end do
       end do
        do i=1, nel
          dt(ix(i)) = dt(ix(i)) + 1.d0
           do k=istb, iste
            do j=1,lint
              st(ix(i),k) = st(ix(i),k) + xpmat(i,j)*sigp(k,j)
            end do
         end do
        end do

      end
c     ****************************************************************72



c     ****************************************************************72
      subroutine stcn05_a(numnp,nen,lint,xl,ix,sigp,dt,st,pmat,istb,
     &                    iste,shp,dvol,l)
c     ****************************************************************72
c     Berechnung der Spannungen an den Knoten
c     Parameter
c         numnp         Anzahl der Knoten des Systems
c         nen           Anzahl der Elementknoten
c         lint          Anzahl der Gausspunkte
c         xl(2,*)       Knotenkoordinaten
c         ix(*)         Knotennummerierung
c         sigp(12,*)    Projektionen fuer Plotausgabe
c         st(numnp,*)   Projizierte Daten
c         dt(*)         Wichtungskoeffizienten
c         pmat(4,4)     Koeffizientenmatrix
c         istb,iste     ID fuer Projektionsfeld
c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      include   'sdata.h'
c     ----------------------------------------------------------------72
c...  compute nodal stresses
      integer numnp, nen, lint, ix(*), i, j, k, iste, istb,l,ii
      real*8 xl(ndm,*), sigp(10,*), st(numnp,*), dt(numnp),pmat(4,4)
      real*8 xmat(6,4), xpmat(6,4), xpm
      real*8 shp(ndm+1,*),dvol,xj

      if (lint.eq.1) then
c...  for linear triangles
        do i=1,nen
          dt(ix(i)) = dt(ix(i)) + 1.d0
          do k=istb, iste
            st(ix(i),k) = st(ix(i),k) + sigp(k,1)
	  end do
	end do
c...  alternative lumping by Taylor
      elseif (lint.ge.3) then
        do i = 1,nen
          xj = shp(3,i)*dvol*shp(3,i)
          dt(ix(i)) = dt(ix(i)) + xj
          do j = 1,24
            st(ix(i),j) = st(ix(i),j) + sigp(j,l)*xj
          end do
        end do
      end if
c     ----------------------------------------------------------------72      
      return
      end
c     ****************************************************************72



c     ****************************************************************72
      subroutine stcn05_3D(nen,ix,shp,dvol,sigp,numnp,dt,st)
c     ****************************************************************72
c     Berechnung der Spannungen an den Knoten
c     Parameter
c         nen           Anzahl der Elementknoten
c         ix(*)         Knotennummerierung
c         shp(4,nel)    Ansatzfunktionen und deren Ableitungen
c         dvol          Jacobideterminante
c         sigp(12,*)    Projektionen fuer Plotausgabe 
c         numnp         Anzahl der Knoten des Systems
c         dt(*)         Wichtungskoeffizienten 
c         st(numnp,*)   Projizierte Daten
c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      include   'sdata.h'
c     ----------------------------------------------------------------72
c.... add contribution of gauss point to global smoothed nodal stresses
c     number 24 of plot variables must correspond with npstr in /pdata3/
      integer numnp,nen,ix(*),i,ll,n,k
      real*8 shp(ndm+1,nen),sigp(10),dt(numnp),st(numnp,1),dvol
c     ----------------------------------------------------------------72

      if (nen.eq.8) then
c... alternative lumping by Taylor
      do i = 1,nen
        ll = ix(i)
        if(ll.gt.0) then
          dt(ll)   = dt(ll)   + shp(4,i)*dvol*shp(4,i)
          do n = 1,24
             st(ll,n) = st(ll,n) + sigp(n)*shp(4,i)*dvol*shp(4,i)
          end do
        end if
      end do
      end if
      
      if (nen.eq.10) then
c... alternative lumping by Taylor
      do i = 1,nen
        ll = ix(i)
        if(ll.gt.0) then
          dt(ll)   = dt(ll)   + shp(4,i)*dvol*shp(4,i)
          do n = 1,24
             st(ll,n) = st(ll,n) + sigp(n)*shp(4,i)*dvol*shp(4,i)
          end do
        end if
      end do
      end if
          
c     ----------------------------------------------------------------72      
      return
      end
c     ****************************************************************72

