     &                    alphahStT,alphahStq,chS,ThetahSt0,fBaEnMi,       
     &                    nhSt0,rhohSRt0,
     &                    alphahLtT,alphahLtq,chL,ThetahLt0,
     &                    nhLt0,rhohLRt0,phLRt0,kLDarcy,
     &                    b,fdyn,
     &                    muhS,lambdahS,komphS,B4,
     &                    alphahSLtq
c     ----------------------------------------------------------------72
      integer ndm,nel
      real*8 shp(ndm+1,nel)
      real*8 RS(60)
      real*8 xppS(3)
      real*8 ShSLlin(3,3)
      real*8 fac1BaMoMi,fac1BaEnMi,fac2BaEnMi
c     ----------------------------------------------------------------72

c...  FAKTOREN
c     ----------------------------------------------------------------72
      fac1BaMoMi = rhohSt0+rhohLt0S
      fac1BaEnMi = rhohSt0*chS+rhohLt0S*chL
      fac2BaEnMi = fBaEnMi*3.0*ThetahS*alphahStT*komphS
