     #2(1,3)*shp(3,3)-RSBaMoMi1(1)*shp(4,3)
      RS(14) = -RSBaMoMi2(2,1)*shp(1,3)-RSBaMoMi2(2,2)*shp(2,3)-RSBaMoMi
     #2(2,3)*shp(3,3)-RSBaMoMi1(2)*shp(4,3)
      RS(15) = -RSBaMoMi2(3,1)*shp(1,3)-RSBaMoMi2(3,2)*shp(2,3)-RSBaMoMi
     #2(3,3)*shp(3,3)-RSBaMoMi1(3)*shp(4,3)
      RS(16) = -RSBaEnMi1(1)*shp(1,3)-RSBaEnMi1(2)*shp(2,3)-RSBaEnMi1(3)
     #*shp(3,3)-RSBaEnMi0*shp(4,3)
      RS(17) = -RSBaMaSo0*shp(4,3)
      RS(18) = -RSSaCoMi1(1)*shp(1,3)-RSSaCoMi1(2)*shp(2,3)-RSSaCoMi1(3)
     #*shp(3,3)-RSSaCoMi0*shp(4,3)
      RS(19) = -RSBaMoMi2(1,1)*shp(1,4)-RSBaMoMi2(1,2)*shp(2,4)-RSBaMoMi
     #2(1,3)*shp(3,4)-RSBaMoMi1(1)*shp(4,4)
      RS(20) = -RSBaMoMi2(2,1)*shp(1,4)-RSBaMoMi2(2,2)*shp(2,4)-RSBaMoMi
     #2(2,3)*shp(3,4)-RSBaMoMi1(2)*shp(4,4)
      RS(21) = -RSBaMoMi2(3,1)*shp(1,4)-RSBaMoMi2(3,2)*shp(2,4)-RSBaMoMi
     #2(3,3)*shp(3,4)-RSBaMoMi1(3)*shp(4,4)
      RS(22) = -RSBaEnMi1(1)*shp(1,4)-RSBaEnMi1(2)*shp(2,4)-RSBaEnMi1(3)
     #*shp(3,4)-RSBaEnMi0*shp(4,4)
      RS(23) = -RSBaMaSo0*shp(4,4)
      RS(24) = -RSSaCoMi1(1)*shp(1,4)-RSSaCoMi1(2)*shp(2,4)-RSSaCoMi1(3)
     #*shp(3,4)-RSSaCoMi0*shp(4,4)
      RS(25) = -RSBaMoMi2(1,1)*shp(1,5)-RSBaMoMi2(1,2)*shp(2,5)-RSBaMoMi
     #2(1,3)*shp(3,5)-RSBaMoMi1(1)*shp(4,5)
      RS(26) = -RSBaMoMi2(2,1)*shp(1,5)-RSBaMoMi2(2,2)*shp(2,5)-RSBaMoMi
     #2(2,3)*shp(3,5)-RSBaMoMi1(2)*shp(4,5)
      RS(27) = -RSBaMoMi2(3,1)*shp(1,5)-RSBaMoMi2(3,2)*shp(2,5)-RSBaMoMi
     #2(3,3)*shp(3,5)-RSBaMoMi1(3)*shp(4,5)
      RS(28) = -RSBaEnMi1(1)*shp(1,5)-RSBaEnMi1(2)*shp(2,5)-RSBaEnMi1(3)
     #*shp(3,5)-RSBaEnMi0*shp(4,5)
      RS(29) = -RSBaMaSo0*shp(4,5)
      RS(30) = -RSSaCoMi1(1)*shp(1,5)-RSSaCoMi1(2)*shp(2,5)-RSSaCoMi1(3)
     #*shp(3,5)-RSSaCoMi0*shp(4,5)
      RS(31) = -RSBaMoMi2(1,1)*shp(1,6)-RSBaMoMi2(1,2)*shp(2,6)-RSBaMoMi
     #2(1,3)*shp(3,6)-RSBaMoMi1(1)*shp(4,6)
      RS(32) = -RSBaMoMi2(2,1)*shp(1,6)-RSBaMoMi2(2,2)*shp(2,6)-RSBaMoMi
     #2(2,3)*shp(3,6)-RSBaMoMi1(2)*shp(4,6)
      RS(33) = -RSBaMoMi2(3,1)*shp(1,6)-RSBaMoMi2(3,2)*shp(2,6)-RSBaMoMi
     #2(3,3)*shp(3,6)-RSBaMoMi1(3)*shp(4,6)
      RS(34) = -RSBaEnMi1(1)*shp(1,6)-RSBaEnMi1(2)*shp(2,6)-RSBaEnMi1(3)
     #*shp(3,6)-RSBaEnMi0*shp(4,6)
      RS(35) = -RSBaMaSo0*shp(4,6)
      RS(36) = -RSSaCoMi1(1)*shp(1,6)-RSSaCoMi1(2)*shp(2,6)-RSSaCoMi1(3)
     #*shp(3,6)-RSSaCoMi0*shp(4,6)
      RS(37) = -RSBaMoMi2(1,1)*shp(1,7)-RSBaMoMi2(1,2)*shp(2,7)-RSBaMoMi
     #2(1,3)*shp(3,7)-RSBaMoMi1(1)*shp(4,7)
      RS(38) = -RSBaMoMi2(2,1)*shp(1,7)-RSBaMoMi2(2,2)*shp(2,7)-RSBaMoMi
     #2(2,3)*shp(3,7)-RSBaMoMi1(2)*shp(4,7)
      RS(39) = -RSBaMoMi2(3,1)*shp(1,7)-RSBaMoMi2(3,2)*shp(2,7)-RSBaMoMi
     #2(3,3)*shp(3,7)-RSBaMoMi1(3)*shp(4,7)
      RS(40) = -RSBaEnMi1(1)*shp(1,7)-RSBaEnMi1(2)*shp(2,7)-RSBaEnMi1(3)
     #*shp(3,7)-RSBaEnMi0*shp(4,7)
      RS(41) = -RSBaMaSo0*shp(4,7)
      RS(42) = -RSSaCoMi1(1)*shp(1,7)-RSSaCoMi1(2)*shp(2,7)-RSSaCoMi1(3)
     #*shp(3,7)-RSSaCoMi0*shp(4,7)
      RS(43) = -RSBaMoMi2(1,1)*shp(1,8)-RSBaMoMi2(1,2)*shp(2,8)-RSBaMoMi
     #2(1,3)*shp(3,8)-RSBaMoMi1(1)*shp(4,8)
      RS(44) = -RSBaMoMi2(2,1)*shp(1,8)-RSBaMoMi2(2,2)*shp(2,8)-RSBaMoMi
     #2(2,3)*shp(3,8)-RSBaMoMi1(2)*shp(4,8)
      RS(45) = -RSBaMoMi2(3,1)*shp(1,8)-RSBaMoMi2(3,2)*shp(2,8)-RSBaMoMi
     #2(3,3)*shp(3,8)-RSBaMoMi1(3)*shp(4,8)
      RS(46) = -RSBaEnMi1(1)*shp(1,8)-RSBaEnMi1(2)*shp(2,8)-RSBaEnMi1(3)
     #*shp(3,8)-RSBaEnMi0*shp(4,8)
      RS(47) = -RSBaMaSo0*shp(4,8)
      RS(48) = -RSSaCoMi1(1)*shp(1,8)-RSSaCoMi1(2)*shp(2,8)-RSSaCoMi1(3)
     #*shp(3,8)-RSSaCoMi0*shp(4,8)
     
c     ****************************************************************72
      end
c     ****************************************************************72

