c     ****************************************************************72
      subroutine UPshpMetrik_jbxx(nen,eg,xl,ul,vl,shp,shpp)
c     ****************************************************************72

c     Berechnung der Ansatzfunktionen und der entsprechenden Ableitungen
c     sowie der Metrik und der Deformationen
c     Parameter:
c     nen       Knoten pro Element
c     ndf       Freiheitsgrade pro Knoten
c     eg(3)     Gausspunkt
c     xl(2,6)   Knotenkoordinaten der Referenzkonfiguration
c     ul(4,6)   Knotenverschiebungen
c     shp(i,6)  i=3   Ansatzfunktionen
c               i=1,2 Ableitungen der Ansatzfunktionen
c                     nach den Koordinaten der Referenzkonfiguration
c     sh0(ndm,nen)  Ableitungen der Ansatzfunktionen
c               nach der Parameterlinien
c               Referenzkonfiguration Solid
c     ht(3,3)   kovariante Metrik
c     hh(3,3)   kontravariante Metrik
c               aktuelle Konfiguration Solid
c     at(3,3)   kovariante Metrik
c     ah(3,3)   kontravariante Metrik
c     Fref(3,3) pseudo Deformationsgradient Referenzkonfiguration
c     Fakt(3,3) pseudo Deformationsgradient aktuelle Konfiguration
c     FtS(3,3)  Deformationsgradient Solid
c     .inv(3,3) inverse Deformationsgradienten
c     det.      Determinanten der Deformationsgradienten
c     ELEMENTTYPEN
c     2D
c     - 4 Knoten Rechteck Linear
c     3D
c     - 8 Knoten Brick Linear

c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      include   'sdata.h'
      include   'eldata.h'
c     ----------------------------------------------------------------72
      include   'xDatMetDefS_jbxx.h'
      include   'xDatBase_jbxx.h'
c     ----------------------------------------------------------------72
      integer nen,i,j,ii,k,o
      real*8 eg(ndm+1),xl(ndm,*),ul(ndf,*),vl(ndf,*)
      real*8 sh0(ndm,nen),shp(ndm+1,nen)
      real*8 sh0p(ndm,nen),shpp(ndm+1,nen)
c     ----------------------------------------------------------------72


c     ----------------------------------------------------------------72
      if (ndm.eq.2) then                   !ndm 2 Start
c     ----------------------------------------------------------------72
c     VIERECK 4-KNOTEN LINEAR
      if (nen.eq.4) then
      call shp_2D_Rec_Lin_jbxx(shp,sh0,eg)
      end if
c     VIERECK 8-KNOTEN QUADRATISCH      
      if (nen.eq.8) then
      call shp_2D_Rec_Qua8_jbxx(shp,sh0,eg)
      call shpp_2D_Rec_Qua8_jbxx(shpp,sh0p,eg)
      end if
c     VIERECK 9-KNOTEN QUADRATISCH      
      if (nen.eq.9) then
      call shp_2D_Rec_Qua9_jbxx(shp,sh0,eg)
      call shpp_2D_Rec_Qua9_jbxx(shpp,sh0p,eg)
      end if      
c     ----------------------------------------------------------------72
      call base2D_jbxx(xl,ul,vl,sh0)
c     ----------------------------------------------------------------72
      end if                               !ndm 2 Ende
c     ----------------------------------------------------------------72
c     ----------------------------------------------------------------72
      if (ndm.eq.3) then                   !ndm 3 Start
c     ----------------------------------------------------------------72
c     BRICK 8-KNOTEN LINEAR
      if (nen.eq.8) then
      call shp_3D_Brick_Lin_jbxx(shp,sh0,eg)
      end if
c     TETRAEDER 10-KNOTEN LINEAR
      if (nen.eq.10) then
      call shp_3D_Tet_Quad_jbxx(shp,sh0,eg)
      end if      
c     ----------------------------------------------------------------72
      call base3D_jbxx(xl,ul,vl,sh0)
c     ----------------------------------------------------------------72
      end if                                !ndm 3 Ende
c     ----------------------------------------------------------------72



c...  Coefficients -- Identity tensor
c     ----------------------------------------------------------------72
      call pzero(Iden,3*3)
      do i = 1,3
      Iden(i,i) = 1.0d0
      end do

      
c...  Coefficients
c     -- Fref, Frefinv
c     -- Fakt, Faktinv
c     -- FtS, FtSinv
c     -- dFtS, dFtSinv
c     ----------------------------------------------------------------72
      do i = 1,3
      do j = 1,3
      Fref(i,j)    = ht1(i)*eh1(j)+ht2(i)*eh2(j)+ht3(i)*eh3(j)
      Frefinv(i,j) = et1(i)*hh1(j)+et2(i)*hh2(j)+et3(i)*hh3(j)
      Fakt(i,j)    = at1(i)*eh1(j)+at2(i)*eh2(j)+at3(i)*eh3(j)
      Faktinv(i,j) = et1(i)*ah1(j)+et2(i)*ah2(j)+et3(i)*ah3(j)
      FtS(i,j)     = at1(i)*hh1(j)+at2(i)*hh2(j)+at3(i)*hh3(j)
      FtSinv(i,j)  = ht1(i)*ah1(j)+ht2(i)*ah2(j)+ht3(i)*ah3(j)
      dFtS(i,j)    = dat1(i)*hh1(j)+dat2(i)*hh2(j)+dat3(i)*hh3(j)
      dFtSinv(i,j) = ht1(i)*dah1(j)+ht2(i)*dah2(j)+ht3(i)*dah3(j)
      end do
      end do

      
c...  Determinants
c     -- detFref
c     -- detFakt
c     -- detdFakt
c     -- detFtS
c     -- JtS = detFtS
c     -- detdFtS
c     -- dJtS = detdFtS
c     ----------------------------------------------------------------72
c     2D
      if (ndm.eq.2) then
      detFref  =  ht1(1)*ht2(2)-ht1(2)*ht2(1)
      detFakt  =  at1(1)*at2(2)-at1(2)*at2(1)
      detdFakt =  dat1(1)*at2(2)+at1(1)*dat2(2)
     &           -dat1(2)*at2(1)-at1(2)*dat2(1)
      end if
c     ---
c     3D
      if (ndm.eq.3) then
      detFref  =  ht1(1)*(ht2(2)*ht3(3)-ht3(2)*ht2(3))
     &           +ht2(1)*(ht3(2)*ht1(3)-ht1(2)*ht3(3))
     &           +ht3(1)*(ht1(2)*ht2(3)-ht2(2)*ht1(3))
      detFakt  =  at1(1)*(at2(2)*at3(3)-at3(2)*at2(3))
     &           +at2(1)*(at3(2)*at1(3)-at1(2)*at3(3))
     &           +at3(1)*(at1(2)*at2(3)-at2(2)*at1(3))
      end if 
c     ---      
      detFtS   = detFakt/detFref
      JtS      = detFtS
      detdFtS  = detdFakt/detFref
      dJtS     = detdFtS


      
c...  Deformation Tensors
c     -- CtS, CtSinv
c     ----------------------------------------------------------------72
      do i = 1,3
      do k = 1,3
      CtS(i,k)    = 0.d0
      CtSinv(i,k) = 0.d0
      do o = 1,3
      CtS(i,k)    = CtS(i,k)+FtS(o,i)*FtS(o,k)
      CtSinv(i,k) = CtSinv(i,k)+FtSinv(i,o)*FtSinv(k,o)
      end do
      end do
      end do
      

c...  Strain Tensors
c     -- EtSlin
c     -- dEtSlin
c     -- EtS
c     -- KRtS
c     ----------------------------------------------------------------72
      do i = 1,3
      do k = 1,3      
      EtSlin(i,k)  = 0.5d0*(FtS(i,k)+FtS(k,i)-2.d0*Iden(i,k))
      dEtSlin(i,k) = 0.5d0*(dFtS(i,k)+dFtS(k,i))
      EtS(i,k)     = 0.5d0*(CtS(i,k)-Iden(i,k))
      KRtS(i,k)    = 0.5d0*(Iden(i,k)-CtSinv(i,k))
      end do
      end do

      
c...  Coefficients
c     -- FtSpS
c     -- CtSpS
c     -- EtSlinpS
c     -- EtSpS
c     ----------------------------------------------------------------72
      do i = 1,3
      do j = 1,3
      FtSpS(i,j)   = at1pS(i)*hh1(j)+at2pS(i)*hh2(j)+at3pS(i)*hh3(j)
      end do
      end do
c     ---
      call pzero(CtSpS,3*3)
      do i = 1,3
      do k = 1,3
      do o = 1,3
      CtSpS(i,k) = CtSpS(i,k)+FtSpS(o,i)*FtS(o,k)+FtS(o,i)*FtSpS(o,k)
      end do
      end do
      end do       
c     ---
      do i = 1,3
      do k = 1,3
      EtSlinpS(i,k) = 0.5d0*(FtSpS(i,k)+FtSpS(k,i))
      EtSpS(i,k)    = 0.5d0*CtSpS(i,k)
      end do
      end do

      
c...  Calculation
c     -- trEtSlin
c     -- trEtSlinp1
c     -- trEtSlinpS
c     -- trEtSpS
c     -- trCtS
c     -- lnJtS
c     ----------------------------------------------------------------72
      trEtSlin   = EtSlin(1,1)+EtSlin(2,2)+EtSlin(3,3)
      trEtSlinp1 = trEtSlin+1.0d0
      trEtSlinpS = EtSlinpS(1,1)+EtSlinpS(2,2)+EtSlinpS(3,3)
      trEtS      = EtS(1,1)+EtS(2,2)+EtS(3,3)
      trEtSpS    = EtSpS(1,1)+EtSpS(2,2)+EtSpS(3,3)
      trCtS      = CtS(1,1)+CtS(2,2)+CtS(3,3)
      lnJtS      = dlog(JtS)
     
     
c...  Calculation of the scalar terms
c     -- EtSlinpS * CtSinv
c     -- EtSpS * CtSinv (BaMa)
c     ----------------------------------------------------------------72
      EtSpStCtSinv    = 0.0d0
      EtSlinpStCtSinv = 0.0d0
      do i = 1,3
      do k = 1,3
      EtSlinpStCtSinv = EtSlinpStCtSinv+EtSlinpS(i,k)*CtSinv(i,k)
      EtSpStCtSinv    = EtSpStCtSinv+EtSpS(i,k)*CtSinv(i,k)
      end do
      end do
      
c...  Berechnung der Ableitungen der Ansatzfunktionen
c...  nach den Koordinaten der Referenzkonfiguration
c     ----------------------------------------------------------------72
      if (ndm.eq.2) then
c     ---
      do ii = 1,nen
      shp(1,ii) = Frefinv(1,1)*sh0(1,ii)+Frefinv(2,1)*sh0(2,ii)
      shp(2,ii) = Frefinv(1,2)*sh0(1,ii)+Frefinv(2,2)*sh0(2,ii)
      end do
c     ---
      if (nen.eq.8.or.nen.eq.9) then
      do ii = 1,nen
      shpp(1,ii) = Frefinv(1,1)*sh0p(1,ii)+Frefinv(2,1)*sh0p(2,ii)
      shpp(2,ii) = Frefinv(1,2)*sh0p(1,ii)+Frefinv(2,2)*sh0p(2,ii)
      end do
      end if
c     ---
      end if
c     ---
c     ---
      if (ndm.eq.3) then
      do ii = 1,nen
      shp(1,ii) =  Frefinv(1,1)*sh0(1,ii)
     &           + Frefinv(2,1)*sh0(2,ii)
     &           + Frefinv(3,1)*sh0(3,ii)
      shp(2,ii)  = Frefinv(1,2)*sh0(1,ii)
     &           + Frefinv(2,2)*sh0(2,ii)
     &           + Frefinv(3,2)*sh0(3,ii)
      shp(3,ii)  = Frefinv(1,3)*sh0(1,ii)
     &           + Frefinv(2,3)*sh0(2,ii)
     &           + Frefinv(3,3)*sh0(3,ii)
      end do
      end if

c     ----------------------------------------------------------------72
      return
      end
c     ****************************************************************72






c     ****************************************************************72
      subroutine base2D_jbxx(xl,ul,vl,sh0)
c     ****************************************************************72
c     Berechnung der Basis und Metrik in 2D
c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      include   'sdata.h'
      include   'cdata.h'
c     ----------------------------------------------------------------72
      include   'xDatMetDefS_jbxx.h'
      include   'xDatBase_jbxx.h'
c     ----------------------------------------------------------------72
      integer i
      real*8 xl(ndm,*),ul(ndf,*),vl(ndf,*),sh0(ndm,nen)
c     ----------------------------------------------------------------72

c...  Koeffizienten Basisvektoren
c     -- eti, ehi (orthonormierte Basis im Ursprung)
c     -- hti (kovariant, Referenzkonfiguration Solid)
c     -- hhi (kontravariant, Referenzkonfiguration Solid)
c     -- ati (kovariant, Momentankonfiguration Solid)
c     -- ahi (kontravariant, Momentankonfiguration Solid)
c     ----------------------------------------------------------------72
      call pzero(et1,3)
      call pzero(et2,3)
      call pzero(et3,3)
      call pzero(eh1,3)
      call pzero(eh2,3)
      call pzero(eh3,3)
      et1(1) = 1.d0
      et2(2) = 1.d0
      et3(3) = 1.d0
      eh1(1) = 1.d0
      eh2(2) = 1.d0
      eh3(3) = 1.d0
c     ---
      call pzero(ht1,3)
      call pzero(ht2,3)
      call pzero(ht3,3)
      do i = 1,nen
      ht1(1) = ht1(1)+sh0(1,i)*xl(1,i)
      ht1(2) = ht1(2)+sh0(1,i)*xl(2,i)
      ht2(1) = ht2(1)+sh0(2,i)*xl(1,i)
      ht2(2) = ht2(2)+sh0(2,i)*xl(2,i)
      end do
      ht3(3) = 1.d0
c     ---
      hh1(1) = ht2(2)/(ht1(1)*ht2(2)-ht2(1)*ht1(2))
      hh1(2) = -ht2(1)/(ht1(1)*ht2(2)-ht2(1)*ht1(2))
      hh1(3) = 0.d0
      hh2(1) = -ht1(2)/(ht1(1)*ht2(2)-ht2(1)*ht1(2))
      hh2(2) = ht1(1)/(ht1(1)*ht2(2)-ht2(1)*ht1(2))
      hh2(3) = 0.d0
      hh3(1) = 0.d0
      hh3(2) = 0.d0
      hh3(3) = 1.d0
c     ---
      call pzero(at1,3)
      call pzero(at2,3)
      call pzero(at3,3)
      do i = 1,nen
      at1(1) = at1(1)+sh0(1,i)*(xl(1,i)+ul(1,i))
      at1(2) = at1(2)+sh0(1,i)*(xl(2,i)+ul(2,i))
      at2(1) = at2(1)+sh0(2,i)*(xl(1,i)+ul(1,i))
      at2(2) = at2(2)+sh0(2,i)*(xl(2,i)+ul(2,i))
      end do
      at3(3) = 1.d0
c     ---
      ah1(1) =  at2(2)/(at1(1)*at2(2)-at2(1)*at1(2))
      ah1(2) = -at2(1)/(at1(1)*at2(2)-at2(1)*at1(2))
      ah1(3) = 0.d0
      ah2(1) = -at1(2)/(at1(1)*at2(2)-at2(1)*at1(2))
      ah2(2) =  at1(1)/(at1(1)*at2(2)-at2(1)*at1(2))
      ah2(3) = 0.d0
      ah3(1) = 0.d0
      ah3(2) = 0.d0
      ah3(3) = 1.d0


c...  Metrikkoeffizienten
c     -- ht (kovariant, Referenzkonfiguration Solid)
c     -- hh (kontravariant, Referenzkonfiguration Solid)
c     -- at (kovariant, Momentankonfiguration Solid)
c     -- ah (kontravariant, Momentankonfiguration Solid)
c     ----------------------------------------------------------------72
      ht(1,1) = ht1(1)**2+ht1(2)**2
      ht(1,2) = ht1(1)*ht2(1)+ht1(2)*ht2(2)
      ht(1,3) = 0.d0
      ht(2,1) = ht(1,2)
      ht(2,2) = ht2(1)**2+ht2(2)**2
      ht(2,3) = 0.d0
      ht(3,1) = 0.d0
      ht(3,2) = 0.d0
      ht(3,3) = 1.d0
c     ---
      hh(1,1) = hh1(1)**2+hh1(2)**2
      hh(1,2) = hh1(1)*hh2(1)+hh1(2)*hh2(2)
      hh(1,3) = 0.0d0
      hh(2,1) = hh(1,2)
      hh(2,2) = hh2(1)**2+hh2(2)**2
      hh(2,3) = 0.d0
      hh(3,1) = 0.d0
      hh(3,2) = 0.d0
      hh(3,3) = 1.d0
c     ---
      at(1,1) = at1(1)**2+at1(2)**2
      at(1,2) = at1(1)*at2(1)+at1(2)*at2(2)
      at(1,3) = 0.0d0
      at(2,1) = at(1,2)
      at(2,2) = at2(1)**2+at2(2)**2
      at(2,3) = 0.d0
      at(3,1) = 0.d0
      at(3,2) = 0.d0
      at(3,3) = 1.d0
c     ---
      ah(1,1) = ah1(1)**2+ah1(2)**2
      ah(1,2) = ah1(1)*ah2(1)+ah1(2)*ah2(2)
      ah(1,3) = 0.0d0
      ah(2,1) = ah(1,2)
      ah(2,2) = ah2(1)**2+ah2(2)**2
      ah(2,3) = 0.d0
      ah(3,1) = 0.d0
      ah(3,2) = 0.d0
      ah(3,3) = 1.d0


c...  Inkremente Koeffizienten Basisvektoren
c     -- dati (kovariant, Momentankonfiguration Solid)
c     -- dahi (kontravariant, Momentankonfiguration Solid)
c     ----------------------------------------------------------------72
      call pzero(dat1,3)
      call pzero(dat2,3)
      call pzero(dat3,3)
      do i = 1,nen
      dat1(1) = dat1(1)+sh0(1,i)*ul(1,i+4)
      dat1(2) = dat1(2)+sh0(1,i)*ul(2,i+4)      
      dat2(2) = dat2(2)+sh0(2,i)*ul(2,i+4)
      dat2(1) = dat2(1)+sh0(2,i)*ul(1,i+4)      
      end do
      dat3(3) = 0.d0
c     ---
      dah1(1) =  dat2(2)/(dat1(1)*dat2(2)-dat2(1)*dat1(2))
      dah1(2) = -dat2(1)/(dat1(1)*dat2(2)-dat2(1)*dat1(2))
      dah1(3) = 0.d0
      dah2(1) = -dat1(2)/(dat1(1)*dat2(2)-dat2(1)*dat1(2))
      dah2(2) =  dat1(1)/(dat1(1)*dat2(2)-dat2(1)*dat1(2))
      dah2(3) = 0.d0
      dah3(1) = 0.d0
      dah3(2) = 0.d0
      dah3(3) = 0.d0


c...  Inkremente Metrikkoeffizienten     
c     -- dat (kovariant, Momentankonfiguration Solid)      
c     -- dah (kontravariant, Momentankonfiguration Solid)      
c     ----------------------------------------------------------------72
      dat(1,1) =  dat1(1)*at1(1)+at1(1)*dat1(1)
     &            +dat1(2)*at1(2)+at1(2)*dat1(2)
      dat(1,2) =  dat1(1)*at2(1)+at1(1)*dat2(1)
     &            +dat1(2)*at2(2)+at1(2)*dat2(2)
      dat(1,3) = 0.d0
      dat(2,1) =  dat2(1)*at1(1)+at2(1)*dat1(1)
     &            +dat2(2)*at1(2)+at2(2)*dat1(2)
      dat(2,2) =  dat2(1)*at2(1)+at2(1)*dat2(1)
     &            +dat2(2)*at2(2)+at2(2)*dat2(2)
      dat(2,3) = 0.d0
      dat(3,1) = 0.d0
      dat(3,2) = 0.d0
      dat(3,3) = 0.d0
c     ---
      dah(1,1) =  dah1(1)*ah1(1)+ah1(1)*dah1(1)
     &            +dah1(2)*ah1(2)+ah1(2)*dah1(2)
      dah(1,2) =  dah1(1)*ah2(1)+ah1(1)*dah1(1)
     &            +dah1(2)*ah2(2)+ah1(2)*dah1(2)
      dah(1,3) = 0.d0
      dah(2,1) =  dah1(1)*ah1(1)+ah2(1)*dah1(1)
     &            +dah1(2)*ah1(2)+ah2(2)*dah1(2)
      dah(2,2) =  dah1(1)*ah2(1)+ah2(1)*dah1(1)
     &            +dah1(2)*ah2(2)+ah2(2)*dah1(2)
      dah(2,3) = 0.d0
      dah(3,1) = 0.d0
      dah(3,2) = 0.d0
      dah(3,3) = 0.d0


c...  materielle Zeitableitungen Basisvektoren
c     -- atips (kovariant, Momentankonfiguration Solid)      
c     -- ahips (kontravariant, Momentankonfiguration Solid)      
c     ----------------------------------------------------------------72
      call pzero(at1pS,3)
      call pzero(at2pS,3)
      call pzero(at3pS,3)
      do i = 1,nen
      at1pS(1) = at1pS(1)+sh0(1,i)*vl(1,i)
      at1pS(2) = at1pS(2)+sh0(1,i)*vl(2,i)
      at2pS(1) = at2pS(1)+sh0(2,i)*vl(1,i)
      at2pS(2) = at2pS(2)+sh0(2,i)*vl(2,i)
      end do
      at3pS(3) = 0.d0
c     ---
      ah1pS(1) =  at2pS(2)/(at1pS(1)*at2pS(2)-at2pS(1)*at1pS(2))
      ah1pS(2) = -at2pS(1)/(at1pS(1)*at2pS(2)-at2pS(1)*at1pS(2))
      ah1pS(3) = 0.d0
      ah2pS(1) = -at1pS(2)/(at1pS(1)*at2pS(2)-at2pS(1)*at1pS(2))
      ah2pS(2) =  at1pS(1)/(at1pS(1)*at2pS(2)-at2pS(1)*at1pS(2))
      ah2pS(3) = 0.d0
      ah3pS(1) = 0.d0
      ah3pS(2) = 0.d0
      ah3pS(3) = 0.d0


c...  materielle Zeitableitungen Metrikkoeffizienten     
c     -- atps (kovariant, Momentankonfiguration Solid)      
c     -- ahps (kontravariant, Momentankonfiguration Solid)      
c     ----------------------------------------------------------------72
      atpS(1,1) =  at1pS(1)*at1(1)+at1(1)*at1pS(1)
     &            +at1pS(2)*at1(2)+at1(2)*at1pS(2)
      atpS(1,2) =  at1pS(1)*at2(1)+at1(1)*at2pS(1)
     &            +at1pS(2)*at2(2)+at1(2)*at2pS(2)
      atpS(1,3) = 0.d0
      atpS(2,1) =  at2pS(1)*at1(1)+at2(1)*at1pS(1)
     &            +at2pS(2)*at1(2)+at2(2)*at1pS(2)
      atpS(2,2) =  at2pS(1)*at2(1)+at2(1)*at2pS(1)
     &            +at2pS(2)*at2(2)+at2(2)*at2pS(2)
      atpS(2,3) = 0.d0
      atpS(3,1) = 0.d0
      atpS(3,2) = 0.d0
      atpS(3,3) = 0.d0
c     ---
      ahpS(1,1) =  ah1pS(1)*ah1(1)+ah1(1)*ah1pS(1)
     &            +ah1pS(2)*ah1(2)+ah1(2)*ah1pS(2)
      ahpS(1,2) =  ah1pS(1)*ah2(1)+ah1(1)*ah2pS(1)
     &            +ah1pS(2)*ah2(2)+ah1(2)*ah2pS(2)
      ahpS(1,3) = 0.d0
      ahpS(2,1) =  ah2pS(1)*ah1(1)+ah2(1)*ah1pS(1)
     &            +ah2pS(2)*ah1(2)+ah2(2)*ah1pS(2)
      ahpS(2,2) =  ah2pS(1)*ah2(1)+ah2(1)*ah2pS(1)
     &            +ah2pS(2)*ah2(2)+ah2(2)*ah2pS(2)
      ahpS(2,3) = 0.d0
      ahpS(3,1) = 0.d0
      ahpS(3,2) = 0.d0
      ahpS(3,3) = 0.d0      
c     ----------------------------------------------------------------72
      return
      end
c     ****************************************************************72



c     ****************************************************************72
      subroutine base3D_jbxx(xl,ul,vl,sh0)
c     ****************************************************************72
c     Berechnung der Der Basis in 3D
c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      include   'sdata.h'
      include   'cdata.h'
c     ----------------------------------------------------------------72
      include   'xDatMetDefS_jbxx.h'
      include   'xDatBase_jbxx.h'
c     ----------------------------------------------------------------72
      integer i,j,ii,k,o,p
      real*8 xl(ndm,*),ul(ndf,*),vl(ndf,*),sh0(ndm,nen)
      real*8 detht,detat, detatpS
c     ----------------------------------------------------------------72

c...  Koeffizienten der orthonormierten Basis im Ursprung
c     ----------------------------------------------------------------72
      call pzero(et1,3)
      call pzero(et2,3)
      call pzero(et3,3)
      call pzero(eh1,3)
      call pzero(eh2,3)
      call pzero(eh3,3)
      et1(1) = 1.d0
      et2(2) = 1.d0
      et3(3) = 1.d0
      eh1(1) = 1.d0
      eh2(2) = 1.d0
      eh3(3) = 1.d0

c...  Koeffizienten der kovarianten Basis der Referenzkonfiguration
c...  Solid bzgl. des Ursprungs
c     ----------------------------------------------------------------72
      call pzero(ht1,3)
      call pzero(ht2,3)
      call pzero(ht3,3)
      do i = 1,nen
      ht1(1) = ht1(1)+sh0(1,i)*xl(1,i)
      ht1(2) = ht1(2)+sh0(1,i)*xl(2,i)
      ht1(3) = ht1(3)+sh0(1,i)*xl(3,i)
      ht2(1) = ht2(1)+sh0(2,i)*xl(1,i)
      ht2(2) = ht2(2)+sh0(2,i)*xl(2,i)
      ht2(3) = ht2(3)+sh0(2,i)*xl(3,i)
      ht3(1) = ht3(1)+sh0(3,i)*xl(1,i)
      ht3(2) = ht3(2)+sh0(3,i)*xl(2,i)
      ht3(3) = ht3(3)+sh0(3,i)*xl(3,i)
      end do

c...  Koeffizienten der kontravarianten Basis der Referenzkonfiguration
c...  Solid bzgl. des Ursprungs
c     ----------------------------------------------------------------72
      detht  =  ht1(1)*ht2(2)*ht3(3)+ht1(2)*ht2(3)*ht3(1)
     &         +ht1(3)*ht2(1)*ht3(2)-ht1(3)*ht2(2)*ht3(1)
     &         -ht1(2)*ht2(1)*ht3(3)-ht1(1)*ht2(3)*ht3(2)
      hh1(1) =  (ht2(2)*ht3(3)-ht2(3)*ht3(2))/detht
      hh1(2) = -(ht2(1)*ht3(3)-ht2(3)*ht3(1))/detht
      hh1(3) =  (ht2(1)*ht3(2)-ht2(2)*ht3(1))/detht
      hh2(1) = -(ht1(2)*ht3(3)-ht1(3)*ht3(2))/detht
      hh2(2) =  (ht1(1)*ht3(3)-ht1(3)*ht3(1))/detht
      hh2(3) = -(ht1(1)*ht3(2)-ht1(2)*ht3(1))/detht
      hh3(1) =  (ht1(2)*ht2(3)-ht1(3)*ht2(2))/detht
      hh3(2) = -(ht1(1)*ht2(3)-ht1(3)*ht2(1))/detht
      hh3(3) =  (ht1(1)*ht2(2)-ht1(2)*ht2(1))/detht

c...  Koeffizienten der kovarianten Basis der aktuellen Konfiguration
c...  Solid bzgl. des Ursprungs
c     ----------------------------------------------------------------72
      call pzero(at1,3)
      call pzero(at2,3)
      call pzero(at3,3)
      do i = 1,nen
      at1(1) = at1(1)+sh0(1,i)*(xl(1,i)+ul(1,i))
      at1(2) = at1(2)+sh0(1,i)*(xl(2,i)+ul(2,i))
      at1(3) = at1(3)+sh0(1,i)*(xl(3,i)+ul(3,i))
      at2(1) = at2(1)+sh0(2,i)*(xl(1,i)+ul(1,i))
      at2(2) = at2(2)+sh0(2,i)*(xl(2,i)+ul(2,i))
      at2(3) = at2(3)+sh0(2,i)*(xl(3,i)+ul(3,i))
      at3(1) = at3(1)+sh0(3,i)*(xl(1,i)+ul(1,i))
      at3(2) = at3(2)+sh0(3,i)*(xl(2,i)+ul(2,i))
      at3(3) = at3(3)+sh0(3,i)*(xl(3,i)+ul(3,i))
      end do

c...  Koeffizienten der kontravarianten Basis der aktuellen
c...  Konfiguration Solid bzgl. des Ursprungs
c     ----------------------------------------------------------------72
      detat =   at1(1)*at2(2)*at3(3)+at1(2)*at2(3)*at3(1)
     &         +at1(3)*at2(1)*at3(2)-at1(3)*at2(2)*at3(1)
     &         -at1(2)*at2(1)*at3(3)-at1(1)*at2(3)*at3(2)
      ah1(1) =  (at2(2)*at3(3)-at2(3)*at3(2))/detat
      ah1(2) = -(at2(1)*at3(3)-at2(3)*at3(1))/detat
      ah1(3) =  (at2(1)*at3(2)-at2(2)*at3(1))/detat
      ah2(1) = -(at1(2)*at3(3)-at1(3)*at3(2))/detat
      ah2(2) =  (at1(1)*at3(3)-at1(3)*at3(1))/detat
      ah2(3) = -(at1(1)*at3(2)-at1(2)*at3(1))/detat
      ah3(1) =  (at1(2)*at2(3)-at1(3)*at2(2))/detat
      ah3(2) = -(at1(1)*at2(3)-at1(3)*at2(1))/detat
      ah3(3) =  (at1(1)*at2(2)-at1(2)*at2(1))/detat

c...  MATERIELLE ZEITABLEITUNG DER KOVARIANTEN BASIS
c...  DER MOMENTANKONFIGURATION SOLID BZGL. DES URSPRUNGS
c     ----------------------------------------------------------------72
      call pzero(at1pS,3)
      call pzero(at2pS,3)
      call pzero(at3pS,3)
      do i = 1,nen
      at1pS(1) = at1pS(1)+sh0(1,i)*vl(1,i)
      at1pS(2) = at1pS(2)+sh0(1,i)*vl(2,i)
      at1pS(3) = at1pS(3)+sh0(1,i)*vl(3,i)
      at2pS(1) = at2pS(1)+sh0(2,i)*vl(1,i)
      at2pS(2) = at2pS(2)+sh0(2,i)*vl(2,i)
      at2pS(3) = at2pS(3)+sh0(2,i)*vl(3,i)
      at3pS(1) = at3pS(1)+sh0(3,i)*vl(1,i)
      at3pS(2) = at3pS(2)+sh0(3,i)*vl(2,i)
      at3pS(3) = at3pS(3)+sh0(3,i)*vl(3,i)
      end do

c...  Koeffizienten der kontravarianten Basis der aktuellen
c...  Konfiguration Solid bzgl. des Ursprungs
c     ----------------------------------------------------------------72
      detatpS  =  at1pS(1)*at2pS(2)*at3pS(3)+at1pS(2)*at2pS(3)*at3pS(1)
     &           +at1pS(3)*at2pS(1)*at3pS(2)-at1pS(3)*at2pS(2)*at3pS(1)
     &           -at1pS(2)*at2pS(1)*at3pS(3)-at1pS(1)*at2pS(3)*at3pS(2)
      ah1pS(1) =  (at2pS(2)*at3pS(3)-at2pS(3)*at3pS(2))/detatpS
      ah1pS(2) = -(at2pS(1)*at3pS(3)-at2pS(3)*at3pS(1))/detatpS
      ah1pS(3) =  (at2pS(1)*at3pS(2)-at2pS(2)*at3pS(1))/detatpS
      ah2pS(1) = -(at1pS(2)*at3pS(3)-at1pS(3)*at3pS(2))/detatpS
      ah2pS(2) =  (at1pS(1)*at3pS(3)-at1pS(3)*at3pS(1))/detatpS
      ah2pS(3) = -(at1pS(1)*at3pS(2)-at1pS(2)*at3pS(1))/detatpS
      ah3pS(1) =  (at1pS(2)*at2pS(3)-at1pS(3)*at2pS(2))/detatpS
      ah3pS(2) = -(at1pS(1)*at2pS(3)-at1pS(3)*at2pS(1))/detatpS
      ah3pS(3) =  (at1pS(1)*at2pS(2)-at1pS(2)*at2pS(1))/detatpS

c...  kovariante Metrikkoeffizienten der Refernzkofiguration Solid
c...  ht(i,k) = hti(o)*htk(o)
c     ----------------------------------------------------------------72
      ht(1,1) = ht1(1)*ht1(1) + ht1(2)*ht1(2) + ht1(3)*ht1(3)
      ht(1,2) = ht1(1)*ht2(1) + ht1(2)*ht2(2) + ht1(3)*ht2(3)
      ht(1,3) = ht1(1)*ht3(1) + ht1(2)*ht3(2) + ht1(3)*ht3(3)
      ht(2,1) = ht2(1)*ht1(1) + ht2(2)*ht1(2) + ht2(3)*ht1(3)
      ht(2,2) = ht2(1)*ht2(1) + ht2(2)*ht2(2) + ht2(3)*ht2(3)
      ht(2,3) = ht2(1)*ht3(1) + ht2(2)*ht3(2) + ht2(3)*ht3(3)
      ht(3,1) = ht3(1)*ht1(1) + ht3(2)*ht1(2) + ht3(3)*ht1(3)
      ht(3,2) = ht3(1)*ht2(1) + ht3(2)*ht2(2) + ht3(3)*ht2(3)
      ht(3,3) = ht3(1)*ht3(1) + ht3(2)*ht3(2) + ht3(3)*ht3(3)

c...  kontravariante Metrikkoeffizienten der Refernzkofiguration Solid
c...  hh(i,k) = hhi(o)*hhk(o)
c     ----------------------------------------------------------------72
      hh(1,1) = hh1(1)*hh1(1) + hh1(2)*hh1(2) + hh1(3)*hh1(3)
      hh(1,2) = hh1(1)*hh2(1) + hh1(2)*hh2(2) + hh1(3)*hh2(3)
      hh(1,3) = hh1(1)*hh3(1) + hh1(2)*hh3(2) + hh1(3)*hh3(3)
      hh(2,1) = hh2(1)*hh1(1) + hh2(2)*hh1(2) + hh2(3)*hh1(3)
      hh(2,2) = hh2(1)*hh2(1) + hh2(2)*hh2(2) + hh2(3)*hh2(3)
      hh(2,3) = hh2(1)*hh3(1) + hh2(2)*hh3(2) + hh2(3)*hh3(3)
      hh(3,1) = hh3(1)*hh1(1) + hh3(2)*hh1(2) + hh3(3)*hh1(3)
      hh(3,2) = hh3(1)*hh2(1) + hh3(2)*hh2(2) + hh3(3)*hh2(3)
      hh(3,3) = hh3(1)*hh3(1) + hh3(2)*hh3(2) + hh3(3)*hh3(3)

c...  kovariante Metrikkoeffizienten der aktuellen Kofiguration Solid
c...  at(i,k) = ati(o)*atk(o)
c     ----------------------------------------------------------------72
      at(1,1) = at1(1)*at1(1) + at1(2)*at1(2) + at1(3)*at1(3)
      at(1,2) = at1(1)*at2(1) + at1(2)*at2(2) + at1(3)*at2(3)
      at(1,3) = at1(1)*at3(1) + at1(2)*at3(2) + at1(3)*at3(3)
      at(2,1) = at2(1)*at1(1) + at2(2)*at1(2) + at2(3)*at1(3)
      at(2,2) = at2(1)*at2(1) + at2(2)*at2(2) + at2(3)*at2(3)
      at(2,3) = at2(1)*at3(1) + at2(2)*at3(2) + at2(3)*at3(3)
      at(3,1) = at3(1)*at1(1) + at3(2)*at1(2) + at3(3)*at1(3)
      at(3,2) = at3(1)*at2(1) + at3(2)*at2(2) + at3(3)*at2(3)
      at(3,3) = at3(1)*at3(1) + at3(2)*at3(2) + at3(3)*at3(3)

c...  kontravariante Metrikkoeffizienten der aktuellen Konfiguration
c...  Solid
c...  ah(i,k) = ahi(o)*ahk(o)
c     ----------------------------------------------------------------72
      ah(1,1)=ah1(1)*ah1(1)+ah1(2)*ah1(2)+ah1(3)*ah1(3)
      ah(1,2)=ah1(1)*ah2(1)+ah1(2)*ah2(2)+ah1(3)*ah2(3)
      ah(1,3)=ah1(1)*ah3(1)+ah1(2)*ah3(2)+ah1(3)*ah3(3)
      ah(2,1)=ah2(1)*ah1(1)+ah2(2)*ah1(2)+ah2(3)*ah1(3)
      ah(2,2)=ah2(1)*ah2(1)+ah2(2)*ah2(2)+ah2(3)*ah2(3)
      ah(2,3)=ah2(1)*ah3(1)+ah2(2)*ah3(2)+ah2(3)*ah3(3)
      ah(3,1)=ah3(1)*ah1(1)+ah3(2)*ah1(2)+ah3(3)*ah1(3)
      ah(3,2)=ah3(1)*ah2(1)+ah3(2)*ah2(2)+ah3(3)*ah2(3)
      ah(3,3)=ah3(1)*ah3(1)+ah3(2)*ah3(2)+ah3(3)*ah3(3)

c...  MATERIELLE ZEITABLEITUNG DER KOVARIANTEN METRIKKOEFFIZIENTEN
c...  DER MOMENTANKONFIGURATION SOLID
c...  atpS(i,k) = atipS(o)*atk(o)+ati(o)*atkpS(o)
c     ----------------------------------------------------------------72
      atpS(1,1) =  at1pS(1)*at1(1)+at1(1)*at1pS(1)
     &            +at1pS(2)*at1(2)+at1(2)*at1pS(2)
     &            +at1pS(3)*at1(3)+at1(3)*at1pS(3)
      atpS(1,2) =  at1pS(1)*at2(1)+at1(1)*at2pS(1)
     &            +at1pS(2)*at2(2)+at1(2)*at2pS(2)
     &            +at1pS(3)*at2(3)+at1(3)*at2pS(3)
      atpS(1,3) =  at1pS(1)*at3(1)+at1(1)*at3pS(1)
     &            +at1pS(2)*at3(2)+at1(2)*at3pS(2)
     &            +at1pS(3)*at3(3)+at1(3)*at3pS(3)
      atpS(2,1) =  at2pS(1)*at1(1)+at2(1)*at1pS(1)
     &            +at2pS(2)*at1(2)+at2(2)*at1pS(2)
     &            +at2pS(3)*at1(3)+at2(3)*at1pS(3)
      atpS(2,2) =  at2pS(1)*at2(1)+at2(1)*at2pS(1)
     &            +at2pS(2)*at2(2)+at2(2)*at2pS(2)
     &            +at2pS(3)*at2(3)+at2(3)*at2pS(3)
      atpS(2,3) =  at2pS(1)*at3(1)+at2(1)*at3pS(1)
     &            +at2pS(2)*at3(2)+at2(2)*at3pS(2)
     &            +at2pS(3)*at3(3)+at2(3)*at3pS(3)
      atpS(3,1) =  at3pS(1)*at1(1)+at3(1)*at1pS(1)
     &            +at3pS(2)*at1(2)+at3(2)*at1pS(2)
     &            +at3pS(3)*at1(3)+at3(3)*at1pS(3)
      atpS(3,2) =  at3pS(1)*at2(1)+at3(1)*at2pS(1)
     &            +at3pS(2)*at2(2)+at3(2)*at2pS(2)
     &            +at3pS(3)*at2(3)+at3(3)*at2pS(3)
      atpS(3,3) =  at3pS(1)*at3(1)+at3(1)*at3pS(1)
     &            +at3pS(2)*at3(2)+at3(2)*at3pS(2)
     &            +at3pS(3)*at3(3)+at3(3)*at3pS(3)

c...  MATERIELLE ZEITABLEITUNG DER KONTRAVARIANTEN METRIKKOEFFIZIENTEN
c...  DER MOMENTANKONFIGURATION SOLID
c...  ahpS(i,k) = ahipS(o)*ahk(o)+ahi(o)*ahkpS(o)
c     ----------------------------------------------------------------72
      ahpS(1,1) =  ah1pS(1)*ah1(1)+ah1(1)*ah1pS(1)
     &            +ah1pS(2)*ah1(2)+ah1(2)*ah1pS(2)
     &            +ah1pS(3)*ah1(3)+ah1(3)*ah1pS(3)
      ahpS(1,2) =  ah1pS(1)*ah2(1)+ah1(1)*ah2pS(1)
     &            +ah1pS(2)*ah2(2)+ah1(2)*ah2pS(2)
     &            +ah1pS(3)*ah2(3)+ah1(3)*ah2pS(3)
      ahpS(1,3) =  ah1pS(1)*ah3(1)+ah1(1)*ah3pS(1)
     &            +ah1pS(2)*ah3(2)+ah1(2)*ah3pS(2)
     &            +ah1pS(3)*ah3(3)+ah1(3)*ah3pS(3)
      ahpS(2,1) =  ah2pS(1)*ah1(1)+ah2(1)*ah1pS(1)
     &            +ah2pS(2)*ah1(2)+ah2(2)*ah1pS(2)
     &            +ah2pS(3)*ah1(3)+ah2(3)*ah1pS(3)
      ahpS(2,2) =  ah2pS(1)*ah2(1)+ah2(1)*ah2pS(1)
     &            +ah2pS(2)*ah2(2)+ah2(2)*ah2pS(2)
     &            +ah2pS(3)*ah2(3)+ah2(3)*ah2pS(3)
      ahpS(2,3) =  ah2pS(1)*ah3(1)+ah2(1)*ah3pS(1)
     &            +ah2pS(2)*ah3(2)+ah2(2)*ah3pS(2)
     &            +ah2pS(3)*ah3(3)+ah2(3)*ah3pS(3)
      ahpS(3,1) =  ah3pS(1)*ah1(1)+ah3(1)*ah1pS(1)
     &            +ah3pS(2)*ah1(2)+ah3(2)*ah1pS(2)
     &            +ah3pS(3)*ah1(3)+ah3(3)*ah1pS(3)
      ahpS(3,2) =  ah3pS(1)*ah2(1)+ah3(1)*ah2pS(1)
     &            +ah3pS(2)*ah2(2)+ah3(2)*ah2pS(2)
     &            +ah3pS(3)*ah2(3)+ah3(3)*ah2pS(3)
      ahpS(3,3) =  ah3pS(1)*ah3(1)+ah3(1)*ah3pS(1)
     &            +ah3pS(2)*ah3(2)+ah3(2)*ah3pS(2)
     &            +ah3pS(3)*ah3(3)+ah3(3)*ah3pS(3)
c     ----------------------------------------------------------------72
      return
      end
c     ****************************************************************72



c     ****************************************************************72
      subroutine shp_2D_Rec_Lin_jbxx(shp,sh0,eg)
c     ****************************************************************72
c     Berechnung 4 Knoten Rechteck Linear 2D
c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      include   'sdata.h'
      include   'cdata.h'
c     ----------------------------------------------------------------72
      real*8 eg(ndm+1)
      real*8 sh0(ndm,nen),shp(ndm+1,nen)
      real*8 rn(4),sn(4)
      data rn/-1.d0,+1.d0,+1.d0,-1.d0/
      data sn/-1.d0,-1.d0,+1.d0,+1.d0/
      integer i
c     ----------------------------------------------------------------72
      do i = 1,nen
      shp(3,i) = 0.25d0*(1.d0+eg(1)*rn(i))*(1.d0+eg(2)*sn(i))
      sh0(1,i) = 0.25d0*rn(i)*(1.d0+eg(2)*sn(i))
      sh0(2,i) = 0.25d0*sn(i)*(1.d0+eg(1)*rn(i))
      end do

      return
      end
c     ****************************************************************72



c     ****************************************************************72
      subroutine shp_2D_Rec_Qua8_jbxx(shp,sh0,eg)
c     ****************************************************************72
c     Berechnung 8 Knoten Rechteck Quadratisch 2D
c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      include   'sdata.h'
      include   'cdata.h'
c     ----------------------------------------------------------------72
      real*8 eg(ndm+1)
      real*8 sh0(ndm,nen),shp(ndm+1,nen)
      integer i
c     ----------------------------------------------------------------72
c...  Ansatzfunktionen
      shp(3,1) = -0.25D0*(0.1D1-eg(1))*(0.1D1-eg(2))*(0.1D1+eg(1)+eg(2))
      shp(3,2) = -0.25D0*(0.1D1+eg(1))*(0.1D1-eg(2))*(0.1D1-eg(1)+eg(2))
      shp(3,3) = -0.25D0*(0.1D1+eg(1))*(0.1D1+eg(2))*(0.1D1-eg(1)-eg(2))
      shp(3,4) = -0.25D0*(0.1D1-eg(1))*(0.1D1+eg(2))*(0.1D1+eg(1)-eg(2))
      shp(3,5) = 0.5D0*(0.1D1-eg(1)**2)*(0.1D1-eg(2))
      shp(3,6) = 0.5D0*(0.1D1+eg(1))*(0.1D1-eg(2)**2)
      shp(3,7) = 0.5D0*(0.1D1-eg(1)**2)*(0.1D1+eg(2))
      shp(3,8) = 0.5D0*(0.1D1-eg(1))*(0.1D1-eg(2)**2)

c...  Ableitung (dshp/dx) Pseudoreferenz in 1-Richtung
      sh0(1,1) = 0.25D0*(0.1D1-eg(2))*(0.1D1+eg(1)+eg(2))-0.25D0*(0.1D1-
     #eg(1))*(0.1D1-eg(2))
      sh0(1,2) = -0.25D0*(0.1D1-eg(2))*(0.1D1-eg(1)+eg(2))+0.25D0*(0.1D1
     #+eg(1))*(0.1D1-eg(2))
      sh0(1,3) = -0.25D0*(0.1D1+eg(2))*(0.1D1-eg(1)-eg(2))+0.25D0*(0.1D1
     #+eg(1))*(0.1D1+eg(2))
      sh0(1,4) = 0.25D0*(0.1D1+eg(2))*(0.1D1+eg(1)-eg(2))-0.25D0*(0.1D1-
     #eg(1))*(0.1D1+eg(2))
      sh0(1,5) = -0.1D1*eg(1)*(0.1D1-eg(2))
      sh0(1,6) = 0.5D0-0.5D0*eg(2)**2
      sh0(1,7) = -0.1D1*eg(1)*(0.1D1+eg(2))
      sh0(1,8) = -0.5D0+0.5D0*eg(2)**2

c...  Ableitung (dshp/dy) Pseudoreferenz in 2-Richtung      
      sh0(2,1) = 0.25D0*(0.1D1-eg(1))*(0.1D1+eg(1)+eg(2))-0.25D0*(0.1D1-
     #eg(1))*(0.1D1-eg(2))
      sh0(2,2) = 0.25D0*(0.1D1+eg(1))*(0.1D1-eg(1)+eg(2))-0.25D0*(0.1D1+
     #eg(1))*(0.1D1-eg(2))
      sh0(2,3) = -0.25D0*(0.1D1+eg(1))*(0.1D1-eg(1)-eg(2))+0.25D0*(0.1D1
     #+eg(1))*(0.1D1+eg(2))
      sh0(2,4) = -0.25D0*(0.1D1-eg(1))*(0.1D1+eg(1)-eg(2))+0.25D0*(0.1D1
     #-eg(1))*(0.1D1+eg(2))
      sh0(2,5) = -0.5D0+0.5D0*eg(1)**2
      sh0(2,6) = -0.1D1*(0.1D1+eg(1))*eg(2)
      sh0(2,7) = 0.5D0-0.5D0*eg(1)**2
      sh0(2,8) = -0.1D1*(0.1D1-eg(1))*eg(2)

      return
      end
c     ****************************************************************72


c     ****************************************************************72
      subroutine shpp_2D_Rec_Qua8_jbxx(shpp,sh0p,eg)
c     ****************************************************************72
c     Berechnung 8 Knoten Rechteck Quadratisch 2D
c     reduzierter Ansatz
c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      include   'sdata.h'
      include   'cdata.h'
c     ----------------------------------------------------------------72
      real*8 eg(ndm+1)
      real*8 sh0p(ndm,nen),shpp(ndm+1,nen)
      integer i
c     ----------------------------------------------------------------72
c...  Ansatzfunktionen
      shpp(3,1) = 0.25D0*(0.1D1-eg(1))*(0.1D1-eg(2))
      shpp(3,2) = 0.25D0*(0.1D1+eg(1))*(0.1D1-eg(2))
      shpp(3,3) = 0.25D0*(0.1D1+eg(1))*(0.1D1+eg(2))
      shpp(3,4) = 0.25D0*(0.1D1-eg(1))*(0.1D1+eg(2))
      shpp(3,5) = 0.0D0
      shpp(3,6) = 0.0D0
      shpp(3,7) = 0.0D0
      shpp(3,8) = 0.0D0

c...  Ableitung (dshp/dx) Pseudoreferenz in 1-Richtung
      sh0p(1,1) = -0.25D0*(0.1D1-eg(2))
      sh0p(1,2) =  0.25D0*(0.1D1-eg(2))
      sh0p(1,3) =  0.25D0*(0.1D1+eg(2))
      sh0p(1,4) = -0.25D0*(0.1D1+eg(2))
      sh0p(1,5) = 0.0D0
      sh0p(1,6) = 0.0D0
      sh0p(1,7) = 0.0D0
      sh0p(1,8) = 0.0D0

c...  Ableitung (dshp/dy) Pseudoreferenz in 2-Richtung      
      sh0p(2,1) = -0.25D0*(0.1D1-eg(1))
      sh0p(2,2) = -0.25D0*(0.1D1+eg(1))
      sh0p(2,3) =  0.25D0*(0.1D1+eg(1))
      sh0p(2,4) =  0.25D0*(0.1D1-eg(1))
      sh0p(2,5) = 0.0D0
      sh0p(2,6) = 0.0D0
      sh0p(2,7) = 0.0D0
      sh0p(2,8) = 0.0D0
                
      return
      end
c     ****************************************************************72



c     ****************************************************************72
      subroutine shp_2D_Rec_Qua9_jbxx(shp,sh0,eg)
c     ****************************************************************72
c     Berechnung 8 Knoten Rechteck Quadratisch 2D
c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      include   'sdata.h'
      include   'cdata.h'
c     ----------------------------------------------------------------72
      real*8 eg(ndm+1)
      real*8 sh0(ndm,nen),shp(ndm+1,nen)
      real*8 rn(8),sn(8)
      data rn/-1.d0,+1.d0,+1.d0,-1.d0,0.0d0,+1.0d0,0.0d0,-1.0d0/
      data sn/-1.d0,-1.d0,+1.d0,+1.d0,-1.0d0,0.0d0,+1.0d0,0.0d0/
      integer i
c     ----------------------------------------------------------------72
      do i = 1,4
      shp(3,i) = 0.25d0*(eg(1)**2+rn(i)*eg(1))*(eg(2)**2+sn(i)*eg(2))
      end do
      do i = 5,8
      shp(3,i) = 0.5d0*rn(i)**2*(eg(1)**2-rn(i)*eg(1))*(1.0d0-eg(2)**2)
     &          +0.5d0*sn(i)**2*(eg(2)**2-sn(i)*eg(2))*(1.0d0-eg(1)**2)
      end do
      shp(3,9) = (1.0d0-eg(1)**2)*(1.0d0-eg(2)**2)
      do i = 1,4
      sh0(1,i) = 0.25d0*(2.0d0*eg(1)+rn(i))*(eg(2)**2+sn(i)*eg(2))
      sh0(2,i) = 0.25d0*(eg(1)**2+rn(i)*eg(1))*(2.0d0*eg(2)+sn(i))      
      end do
      do i = 5,8
      sh0(1,i) = 0.5d0*rn(i)**2*(2.0d0*eg(1)-rn(i))*(1.0d0-eg(2)**2)
     &          +0.5d0*sn(i)**2*(eg(2)**2-sn(i)*eg(2))*(-2.0d0*eg(1))                
      sh0(2,i) = 0.5d0*rn(i)**2*(eg(1)**2-rn(i)*eg(1))*(-2.0d0*eg(2))
     &          +0.5d0*sn(i)**2*(2.0d0*eg(2)-sn(i))*(1.0d0-eg(1)**2)                
      end do
      sh0(1,9) = (-2.0d0*eg(1))*(1.0d0-eg(2)**2)
      sh0(2,9) = (1.0d0-eg(1)**2)*(-2.0d0*eg(2))
      
c...  Ansatzfunktionen      
      shp(3,1) = 0.25D0*(eg(1)**2-eg(1))*(eg(2)**2-eg(2))
      shp(3,2) = 0.25D0*(eg(1)**2+eg(1))*(eg(2)**2-eg(2))
      shp(3,3) = 0.25D0*(eg(1)**2+eg(1))*(eg(2)**2+eg(2))
      shp(3,4) = 0.25D0*(eg(1)**2-eg(1))*(eg(2)**2+eg(2))
      shp(3,5) = 0.5D0*(eg(2)**2+eg(2))*(0.1D1-eg(1)**2)
      shp(3,6) = 0.5D0*(eg(1)**2-eg(1))*(0.1D1-eg(2)**2)
      shp(3,7) = 0.5D0*(eg(2)**2-eg(2))*(0.1D1-eg(1)**2)
      shp(3,8) = 0.5D0*(eg(1)**2+eg(1))*(0.1D1-eg(2)**2)
      shp(3,9) = (0.1D1-eg(1)**2)*(0.1D1-eg(2)**2)
      
c...  Ableitung (dshp/dx) Pseudoreferenz in 1-Richtung      
      sh0(1,1) = 0.25D0*(2*eg(1)-1)*(eg(2)**2-eg(2))
      sh0(1,2) = 0.25D0*(2*eg(1)+1)*(eg(2)**2-eg(2))
      sh0(1,3) = 0.25D0*(2*eg(1)+1)*(eg(2)**2+eg(2))
      sh0(1,4) = 0.25D0*(2*eg(1)-1)*(eg(2)**2+eg(2))
      sh0(1,5) = -0.1D1*(eg(2)**2+eg(2))*eg(1)
      sh0(1,6) = 0.5D0*(2*eg(1)-1)*(0.1D1-eg(2)**2)
      sh0(1,7) = -0.1D1*(eg(2)**2-eg(2))*eg(1)
      sh0(1,8) = 0.5D0*(2*eg(1)+1)*(0.1D1-eg(2)**2)
      sh0(1,9) = -2*eg(1)*(0.1D1-eg(2)**2)
      
c...  Ableitung (dshp/dy) Pseudoreferenz in 2-Richtung       
      sh0(2,1) = 0.25D0*(eg(1)**2-eg(1))*(2*eg(2)-1)
      sh0(2,2) = 0.25D0*(eg(1)**2+eg(1))*(2*eg(2)-1)
      sh0(2,3) = 0.25D0*(eg(1)**2+eg(1))*(2*eg(2)+1)
      sh0(2,4) = 0.25D0*(eg(1)**2-eg(1))*(2*eg(2)+1)
      sh0(2,5) = 0.5D0*(2*eg(2)+1)*(0.1D1-eg(1)**2)
      sh0(2,6) = -0.1D1*(eg(1)**2-eg(1))*eg(2)
      sh0(2,7) = 0.5D0*(2*eg(2)-1)*(0.1D1-eg(1)**2)
      sh0(2,8) = -0.1D1*(eg(1)**2+eg(1))*eg(2)
      sh0(2,9) = -2*(0.1D1-eg(1)**2)*eg(2)      
      
      return
      end
c     ****************************************************************72



c     ****************************************************************72
      subroutine shpp_2D_Rec_Qua9_jbxx(shpp,sh0p,eg)
