      sh0p(2,4) =  0.25D0*(0.1D1-eg(1))
      sh0p(2,5) = 0.0D0
      sh0p(2,6) = 0.0D0
      sh0p(2,7) = 0.0D0
      sh0p(2,8) = 0.0D0
      sh0p(2,9) = 0.0D0

      return
      end
