c     ****************************************************************72
      subroutine shp_3D_Brick_Lin_jbxx(shp,sh0,eg)
c     ****************************************************************72
c     Berechnung 8 Knoten Brick Linear 3D
c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      include   'sdata.h'
      include   'cdata.h'
c     ----------------------------------------------------------------72
      integer i
      real*8 eg(ndm+1)
      real*8 sh0(ndm,nen),shp(ndm+1,nen)
      real*8 rn(8),sn(8),tn(8)
      data rn/-1.d0,+1.d0,+1.d0,-1.d0,-1.d0,+1.d0,+1.d0,-1.d0/
      data sn/-1.d0,-1.d0,+1.d0,+1.d0,-1.d0,-1.d0,+1.d0,+1.d0/
      data tn/-1.d0,-1.d0,-1.d0,-1.d0,+1.d0,+1.d0,+1.d0,+1.d0/
c     ----------------------------------------------------------------72

c...  Shape Functions and Derivations
      do i = 1,nen
      shp(4,i) = 0.125d0*
     &   (1.0d0+rn(i)*eg(1))*(1.0d0+sn(i)*eg(2))*(1.0d0+tn(i)*eg(3))
      sh0(1,i)=0.125d0*rn(i)*(1.0d0+sn(i)*eg(2))*(1.0d0+tn(i)*eg(3))
      sh0(2,i)=0.125d0*sn(i)*(1.0d0+rn(i)*eg(1))*(1.0d0+tn(i)*eg(3))
      sh0(3,i)=0.125d0*tn(i)*(1.0d0+rn(i)*eg(1))*(1.0d0+sn(i)*eg(2))
      end do

      return
      end
c     ****************************************************************72




c     ****************************************************************72
      subroutine shp_3D_Tet_Quad_jbxx(shp,sh0,eg)
c     ****************************************************************72
c     Berechnung 10 Knoten Tet Quad 3D
c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      include   'sdata.h'
      include   'cdata.h'
c     ----------------------------------------------------------------72
      real*8 eg(ndm+1),r,s,t
      real*8 sh0(ndm,nen),shp(ndm+1,nen)
c     ----------------------------------------------------------------72
      r = eg(1)
      s = eg(2)
      t = eg(3)
c...  Shape Functions for 10-Node Tet-Element
      shp(4,1)  = 1.d0-3.d0*r-3.d0*s-3.d0*t+2.d0*r**2.d0+2.d0*s**2.d0
     &           +2.d0*t**2.d0+4.d0*r*s+4.d0*s*t+4.d0*r*t
      shp(4,2)  = r*(2.d0*r-1.d0)
      shp(4,3)  = s*(2.d0*s-1.d0)
      shp(4,4)  = t*(2.d0*t-1.d0)
      shp(4,5)  = 4.d0*r*(1.d0-r-s-t)
      shp(4,6)  = 4.d0*r*s
      shp(4,7)  = 4.d0*s*(1.d0-r-s-t)
      shp(4,8)  = 4.d0*t*(1.d0-r-s-t)
      shp(4,9)  = 4.d0*r*t
      shp(4,10) = 4.d0*s*t

c.....Derivatives
      sh0(1,1)  =-3.d0+4.d0*(r+s+t)
      sh0(1,2)  = -1.d0+4.d0*r
      sh0(1,3)  = 0.d0
      sh0(1,4)  = 0.d0
      sh0(1,5)  = 4.d0*(1.d0-2.d0*r-s-t)
      sh0(1,6)  = 4.d0*s
      sh0(1,7)  = -4.d0*s
      sh0(1,8)  = -4.d0*t
      sh0(1,9)  = 4.d0*t
      sh0(1,10) = 0.d0
c
      sh0(2,1)  = -3.d0+4.d0*(r+s+t)
      sh0(2,2)  = 0.d0
      sh0(2,3)  = -1.d0+4.d0*s
      sh0(2,4)  = 0.d0
      sh0(2,5)  = -4.d0*r
      sh0(2,6)  = 4.d0*r
      sh0(2,7)  = 4.d0*(1.d0-r-2.d0*s-t)
      sh0(2,8)  = -4.d0*t
      sh0(2,9)  = 0.d0
      sh0(2,10) = 4.d0*t
c
      sh0(3,1)  = -3.d0+4.d0*(r+s+t)
      sh0(3,2)  = 0.d0
      sh0(3,3)  = 0.d0
      sh0(3,4)  = -1.d0+4.d0*t
      sh0(3,5)  = -4.d0*r
      sh0(3,6)  = 0.d0
      sh0(3,7)  = -4.d0*s
      sh0(3,8)  = 4.d0*(1.d0-r-s-2.d0*t)
      sh0(3,9)  = 4.d0*r
      sh0(3,10) = 4.d0*s
c
      return
      end
c     ****************************************************************72

c     ****************************************************************72
      subroutine UPAbleitung_jbxx(dt)
c     ****************************************************************72

c     Unterprogramm zur Berechnung der Ableitungen bzgl.
c     der Tangentenmoduli
c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      include   'sdata.h'
      include   'eldata.h'
c     ----------------------------------------------------------------72
      include   'xDatMetDefS_jbxx.h'
      include   'xDatB_jbxx.h'
      include   'xDatMaPa_jbxx.h'
c     ----------------------------------------------------------------72
      integer ii,ik,io,ip,ir,is
      real*8 dt
c     ----------------------------------------------------------------72


c     ----------------------------------------------------------------72
c...  COMPUTE SECOND-ORDER STRUCTURAL TENSOR
c     ----------------------------------------------------------------72
c     Mten = avec # avec
      do ii = 1,3
      do ik = 1,3
      Mten(ii,ik) = avec(ii)*avec(ik)
      end do
      end do
c     ----------------------------------------------------------------72


c     ----------------------------------------------------------------72
c...  COMPUTE 4-ORDER FUNDAMENTAL TENSORS
c     ----------------------------------------------------------------72
c     IoIT23  =  (I#I)^T23 = dFndF
c     IoIT24  =  (I#I)^T24 = dFTndF
c     IoIT23T = ((I#I)^T23)^T
c     IoIT24T = ((I#I)^T24)^T      
      do ii = 1,3
      do ik = 1,3
      do io = 1,3
      do ip = 1,3
      IoIT23(ii,ik,io,ip)  = Iden(ii,io)*Iden(ik,ip)
      IoIT24(ii,ik,io,ip)  = Iden(ii,ip)*Iden(io,ik)
      IoIT23T(ii,ik,io,ip) = Iden(ik,ip)*Iden(ii,io)
      IoIT24T(ii,ik,io,ip) = Iden(io,ik)*Iden(ii,ip)     
      end do
      end do
      end do
      end do
c     ---
c     Iden4a = 1/2 (IoIT23+IoIT24)
      do ii = 1,3
      do ik = 1,3
      do io = 1,3
      do ip = 1,3
      Iden4a(ii,ik,io,ip) =  0.5d0*IoIT23(ii,ik,io,ip)
     &                      +0.5d0*IoIT24(ii,ik,io,ip)
      end do
      end do
      end do
      end do
c     ---
c     Iden4aT = Iden4a^T
      do ii = 1,3
      do ik = 1,3
      do io = 1,3
      do ip = 1,3
      Iden4aT(ii,ik,io,ip) = Iden4a(io,ip,ii,ik)
      end do
      end do
      end do
      end do
c     ----------------------------------------------------------------72



c     ----------------------------------------------------------------72
c...  COMPUTE DERIVATIONS 1
c     ----------------------------------------------------------------72
c     JtSnFtS = JtS FtSinv^T
      do ii = 1,3
      do ik = 1,3
      JtSnFtS(ii,ik) = JtS*FtSinv(ik,ii)
      end do
      end do
c     ---
c     EtSlinnFtS = 1/2 ( (Iden#Iden)^T23 + (Iden#Iden)^T24 )
      do ii = 1,3
      do ik = 1,3
      do io = 1,3
      do ip = 1,3
      EtSLinnFtS(ii,ik,io,ip) =  0.5d0*( IoIT23(ii,ik,io,ip)
     &                                  +IoIT24(ii,ik,io,ip))
      end do
      end do
      end do
      end do
c     ---
c     CtSnFtS = (Iden#FtS)^T24 +(FtS^T#Iden)^T23
      do ii = 1,3
      do ik = 1,3
      do io = 1,3
      do ip = 1,3
      CtSnFtS(ii,ik,io,ip) =  Iden(ii,ip)*FtS(io,ik)
     &                       +FtS(ik,io)*Iden(ii,ip)
      end do
      end do
      end do
      end do
c     ---
c     EtSnFtS = 1/2 CtSnFtS
      do ii = 1,3
      do ik = 1,3
      do io = 1,3
      do ip = 1,3
      EtSnFtS(ii,ik,io,ip) = 0.5d0*CtSnFtS(ii,ik,io,ip)     
      end do
      end do
      end do
      end do
c     ---
c     CtSinvnCtS = -(CtSinv#CtSinv^T)^T24
      do ii = 1,3
      do ik = 1,3
      do io = 1,3
      do ip = 1,3
      CtSinvnCtS(ii,ik,io,ip) = -CtSinv(ii,io)*CtSinv(ip,ik)
      end do
      end do
      end do
      end do
c     ---
c     CtSinvnFtS = CtSinvnCtS CtSnFtS
      do ii = 1,3
      do ik = 1,3
      do io = 1,3
      do ip = 1,3
      CtSinvnFtS(ii,ik,io,ip) = 0.0d0
      do ir = 1,3
      do is = 1,3
      CtSinvnFtS(ii,ik,io,ip) = CtSinvnFtS(ii,ik,io,ip)
     &                  +CtSinvnCtS(ii,ik,ir,is)*CtSnFtS(ir,is,io,ip)
      end do
      end do
      end do
      end do
      end do
      end do
c     ---
c     FtSinvnFtS = -(FtSinv#FtSinv^T)^T24
      do ii = 1,3
      do ik = 1,3
      do io = 1,3
      do ip = 1,3
      FtSinvnFtS(ii,ik,io,ip) = -FtSinv(ii,io)*FtSinv(ip,ik)
      end do
      end do
      end do
      end do
c     ---
c     EtSpSnFtS = 1/2 (FtSpS^T#Iden)^T23 + 1/2 (Iden#FtSpS)^T24
      do ii = 1,3
      do ik = 1,3
      do io = 1,3
      do ip = 1,3
      EtSpSnFtS(ii,ik,io,ip) =  1.0d0/2.0d0*FtSpS(ik,io)*Iden(ii,ip)
     &                         +1.0d0/2.0d0*Iden(ii,ip)*FtSpS(io,ik)
      end do
      end do
      end do
      end do  
c     ---
c     EtSpSnFtSpS = 1/2 (Iden#FtS)^T24 + 1/2 (FtS^T#Iden)^T23
      do ii = 1,3
      do ik = 1,3
      do io = 1,3
      do ip = 1,3
      EtSpSnFtSpS(ii,ik,io,ip) =  1.0d0/2.0d0*Iden(ii,ip)*FtS(io,ik)
     &                           +1.0d0/2.0d0*FtS(ik,io)*Iden(ii,ip)
      end do
      end do
      end do
      end do
c     ----------------------------------------------------------------72


c     ----------------------------------------------------------------72
c     COMPUTE DERIVATIONS 2
c     EtSpStCtSinv(FtS) = EtSpS(FtS)**CtSinv(FtS)
c     wtLS0S(FtS, GradPhLR)
c     qhSt0S(FtS, GradThetahS)
c     qhSLt0S(FtS, GradThetahS)
c     rhohL(FtS), rhohLt0S(FtS)
c     nhL(FtS), nhLt0S(FtS),
c     ----------------------------------------------------------------72      
c     EtSpStCtSinvanFtS = d(EtSpS*CtSinv)/dFtS
      do ii = 1,3
      do ik = 1,3
      EtSpStCtSinvanFtS(ii,ik) = 0.0d0
      do io = 1,3
      do ip = 1,3           
      EtSpStCtSinvanFtS(ii,ik) =
     &                  EtSpStCtSinvanFtS(ii,ik)
     &                 +EtSpSnFtS(ii,ik,io,ip)*CtSinv(io,ip)
     &                 +EtSpSnFtSpS(ii,ik,io,ip)*2.0d0/dt*CtSinv(io,ip)
     &                 +EtSpS(io,ip)*CtSinvnFtS(io,ip,ii,ik)
      end do
      end do
      end do
      end do
c     ---
c     wtLS0SnFtS = dwtLS0S/dFtS
      do ii = 1,3
      do io = 1,3
      do ip = 1,3
      wtLS0SnFtS(ii,io,ip) = 0.0d0
      do ik = 1,3
      wtLS0SnFtS(ii,io,ip) = wtLS0SnFtS(ii,io,ip)
     &          -khLDarcy*CtSinv(ii,ik)*GradphLR(ik)*JtSnFtS(io,ip)
     &          -khLDarcy*JtS*GradphLR(ik)*CtSinvnFtS(ii,ik,io,ip)
     &          +khLDarcy*rhohLR*FtSinv(ii,ik)*b(ik)*JtSnFtS(io,ip)
     &          +khLDarcy*rhohLR*b(ik)*FtSinvnFtS(ii,ik,io,ip)
      end do
      end do
      end do
      end do
c     ---
c     wtLS0SnGphLR = dwtLS0S/dGradphLR
      do ii = 1,3
      do ik = 1,3
      wtLS0SnGphLR(ii,ik) = -khLDarcy*JtS*CtSinv(ii,ik)
      end do
      end do
c     ---
c     qhSt0SnFtS  = dqhSt0S/dFtS
c     qhSLt0SnFtS = dqhSLt0S/dFtS
      do ii = 1,3
      do io = 1,3
      do ip = 1,3
      qhSt0SnFtS(ii,io,ip)  = 0.0d0
      qhSLt0SnFtS(ii,io,ip) = 0.0d0
      do ik = 1,3
      qhSt0SnFtS(ii,io,ip)  = qhSt0SnFtS(ii,io,ip)
     &       -alphahStq*CtSinv(ii,ik)*GradThetahS(ik)*JtSnFtS(io,ip)
     &       -alphahStq*JtS*GradThetahS(ik)*CtSinvnFtS(ii,ik,io,ip)      
      qhSLt0SnFtS(ii,io,ip) = qhSLt0SnFtS(ii,io,ip)
     &       -alphahSLtq*CtSinv(ii,ik)*GradThetahS(ik)*JtSnFtS(io,ip)
     &       -alphahSLtq*JtS*GradThetahS(ik)*CtSinvnFtS(ii,ik,io,ip)
      end do
      end do
      end do
      end do
c     ---
c     qhSt0SnGThetahS  = dqhSt0S/dFThetahS
c     qhSLt0SnGThetahS = dqhSLt0S/dFThetahS
      do ii = 1,3
      do ik = 1,3
      qhSt0SnGThetahS(ii,ik)  = -JtS*alphahStq*CtSinv(ii,ik)      
      qhSLt0SnGThetahS(ii,ik) = -JtS*alphahSLtq*CtSinv(ii,ik)
      end do
      end do
c     ---
c     rhohLnFtS = drhohL/dFtS
      do ii = 1,3
      do ik = 1,3
      rhohLnFtS(ii,ik) = nhSt0*1.0d0/JtS**2*rhohLR*JtSnFtS(ii,ik)
      end do
      end do
c     ---
c     rhohLt0SnFtS = drhohLt0S/dFtS
      do ii = 1,3
      do ik = 1,3
      rhohLt0SnFtS(ii,ik) = rhohLR*JtSnFtS(ii,ik)
      end do
      end do
c     ---
c     nhSnFtS = dnhL/dFtS
      do ii = 1,3
      do ik = 1,3
      nhLnFtS(ii,ik) = nhSt0*1.0d0/JtS**2*JtSnFtS(ii,ik)
      end do
      end do
c     ---      
c     nhLt0SnFtS = dnhLt0S/dFtS
      do ii = 1,3
      do ik = 1,3
      nhLt0SnFtS(ii,ik) = JtSnFtS(ii,ik)
      end do
      end do
c     ----------------------------------------------------------------72      





c
      return
      end
c     ****************************************************************72

c     ****************************************************************72
      subroutine UPGauss_jbxx(ndm,nen,lint,eg,wg)
c     ****************************************************************72
c     Berechnung der Gausspunkte und deren Wichtungsfaktoren
c     2D-Elemente
c     QUADRATIC ELEMENTS     -- nodes = 4,8,9
c     3D-Elemente
c     LINEAR BRICK ELEMENTS  -- nodes = 8
c     QUADRATIC TET ELEMENTS -- nodes = 10
c     Parameter:
c       nen       Knotenanzahl des Elements
c       wg(4)     Wichtungsfaktoren
c       lint      Anzahl der Gausspunkte
c       eg(2,4)   Koordinaten der Gausspunkte
c     ----------------------------------------------------------------72
      implicit none
c     ----------------------------------------------------------------72
      integer ndm,nen,lint,ii
      real*8 pg,g1,g2
      real*8 eg(3,9),wg(9)
c     ----------------------------------------------------------------72


      if (ndm.eq.2) then                              ! ndm 2 Start
c     ----------------------------------------------------------------72
c...  QUADRATIC ELEMENTS
c     ----------------------------------------------------------------72
      if (nen.eq.4) then
c...  4-POINT GAUSS INTEGRATION
      if (lint.eq.4) then
      pg = 1.d0/dsqrt(3.d0)
      eg(1,1) = -pg
      eg(2,1) = -pg
      eg(1,2) =  pg
      eg(2,2) = -pg      
      eg(1,3) =  pg
      eg(2,3) =  pg
      eg(1,4) = -pg
      eg(2,4) =  pg
c     Wichtungsfaktoren 
      do ii  = 1,4
      wg(ii) = 1.0d0
      end do
      end if                                            ! lint=4 Ende   
      end if                                            ! nen =4 Ende
c     ----------------------------------------------------------------72
      if (nen.eq.8.or.nen.eq.9) then
c...  9-POINT GAUSS INTEGRATION
      if (lint.eq.9) then
      pg = dsqrt(3.d0/5.0d0)
      eg(1,1) = -pg
      eg(2,1) = -pg
      eg(1,2) =  0.0d0
      eg(2,2) = -pg      
      eg(1,3) = +pg
      eg(2,3) = -pg
      eg(1,4) = -pg
      eg(2,4) =  0.0d0
      eg(1,5) =  0.0d0
      eg(2,5) =  0.0d0      
      eg(1,6) = +pg
      eg(2,6) =  0.0d0      
      eg(1,7) = -pg
      eg(2,7) = +pg      
      eg(1,8) =  0.0d0
      eg(2,8) = +pg      
      eg(1,9) = +pg
      eg(2,9) = +pg           
c     Wichtungsfaktoren 
      wg(1) = 25.0d0/81.0d0
      wg(2) = 40.0d0/81.0d0
      wg(3) = 25.0d0/81.0d0
      wg(4) = 40.0d0/81.0d0
      wg(5) = 64.0d0/81.0d0
      wg(6) = 40.0d0/81.0d0
      wg(7) = 25.0d0/81.0d0
      wg(8) = 40.0d0/81.0d0
      wg(9) = 25.0d0/81.0d0
      end if                                            ! lint=9 Ende   
      end if                                            ! nen =8/9 Ende
c     ----------------------------------------------------------------72
      
      end if                                            ! ndm =2 Ende                 
c     ----------------------------------------------------------------72      
      
      
      
      if (ndm.eq.3) then                                ! ndm=3  Start  
c     ----------------------------------------------------------------72
c...  LINEAR BRICK ELEMENTS 8 NODES -3D-
c     ----------------------------------------------------------------72
      if (nen.eq.8) then
c...  8-POINT GAUSS INTEGRATION
      if(lint.eq.8) then                                  
      pg = 1.d0/dsqrt(3.d0)
      eg(1,1) = -pg
      eg(2,1) = -pg
      eg(3,1) = -pg
      eg(1,2) =  pg
      eg(2,2) = -pg
      eg(3,2) = -pg
      eg(1,3) =  pg
      eg(2,3) =  pg
      eg(3,3) = -pg
      eg(1,4) = -pg
      eg(2,4) =  pg
      eg(3,4) = -pg
      eg(1,5) = -pg
      eg(2,5) = -pg
      eg(3,5) =  pg
      eg(1,6) =  pg
      eg(2,6) = -pg
      eg(3,6) =  pg
      eg(1,7) =  pg
      eg(2,7) =  pg
      eg(3,7) =  pg
      eg(1,8) = -pg
      eg(2,8) =  pg
      eg(3,8) =  pg    
c     Wichtungsfaktoren 
      do ii  = 1,8
      wg(ii) = 1.0d0
      end do
      end if                                           ! lint=8 Ende
      end if                                           ! nen =8 Ende
c     ----------------------------------------------------------------72

c     ----------------------------------------------------------------72
c...  QUADRATIC TET ELEMENTS 10 NODES -3D-
c     ----------------------------------------------------------------72
      if (nen.eq.10) then
c...  4-POINT GAUSS INTEGRATION
      if(lint.eq.4) then                                  
      g1 = 0.585410196624968
      g2 = 0.138196601125015
      do ii = 1,4
      eg(1,ii) = g2
      eg(2,ii) = g2
      eg(3,ii) = g2
      end do
      eg(1,2) = g1
      eg(2,3) = g1
      eg(3,4) = g1
c     Wichtungsfaktoren
      do ii  = 1,4
      wg(ii) = 0.25d0/6.d0
      end do
      end if                                            ! lint= 4 Ende
      end if                                            ! nen =10 Ende                       
c     ----------------------------------------------------------------72       
      
      end if                                            ! ndm = 3 Ende   
c     ----------------------------------------------------------------72      
         
c     ----------------------------------------------------------------72
      return
      end
c     ****************************************************************72


















